INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('36', 'I left my purse at church this morning. Please let me know if someone turned it in. All my identification, money and personal info is in my purse. If someone can reach out and let me know something I will appreciate it. Thank you'),
('60', 'I have discussed this request with my husband, Lee  and he supports my making this request. We have prayed consistently and know this promotion was ordained by God.\r\n\r\nI would like to know  if Pastor Marvin and Pastor Deborah would be willing to come to my new office, preferably after 6 pm during the week or on a Saturday to bless my new office and speak blessings over my new assignment as Chief of the Orange County Corrections Department.\r\n\r\nIf this is something they feel is unnecessary I will understand, but I really do respect their authority in my life.\r\n\r\nThank you,\r\n\r\nCornita A. Riley'),
('75', 'First and foremost, I am most thankful for being a part of a church FAMILY that cares and displays LOVE at all times.  I am currently a federal employee (NASA) on furlough.  I saw Pastor J\'s post on Facebook yesterday (10/7) about taking care of ROLCC members who are on furlough due to the government shutdown and my heart was so filled. My husband and I attended 9 am service on this past Sunday and I would like to know more about the blessing that pastor mentioned on his Facebook post yesterday.  Was this mentioned at 9 am service and I somehow missed it or was it only during 11 am service?  We have yet to receive federal pay and we\'re not sure if or when we will, so my husband and I would love to know more about this.  Thanks, Stacie'),
('153', 'Hello! \r\n\r\n\r\n\r\nMy name name is Robin Smith and Im pleased to announce the new release of my book, Perfumed Letters. \r\n\r\n\r\n\r\nEvery woman knows how special it is to select just the right perfumeand how a scent can capture an experience or evoke a memory like nothing else. In Perfumed Letters, Robin Smith offers a refreshing spiritual revelation regarding the intimacy of perfume, known as a womans anointing. She uses powerful, evocative images from the Bible and life experiences to illustrate how God refines, presses, and fashions our individual scents as pleasing to the Lord.\r\n \r\n\r\nDiscover: Are you a concrete, absolute or an essential oil?\r\nFragrances that attract blessing and repel favor\r\nThe purpose and influence of a Perfumed Letter\r\nHow God uses fragrance to remember His covenant with you\r\n Your signature fragrance in Christ and so much more! \r\n\r\nWith writing that is fragrant with His word, love and experience, Robin gives a unique perspective on the ways in which each woman is fashioned in the aroma of His Spiritimportant and valuable to Him, written as His Perfumed Letter.\r\n \r\nI would be honored if your book club would review my book.\r\n\r\nISBN: 978-1478713876\r\nFormat: 9 x 6, Paperback\r\nRetail Price: $12.95\r\nKindle Edition: $9.95\r\nNook Edition: $9.95\r\n\r\nAvailable through Ingram Book Wholesalers and online through Amazon and Barnes & Noble or visit http://www.outskirtspress.com. \r\n\r\n\r\n\r\nThank you.\r\n\r\nSincerely,\r\n\r\nMiss Robin Smith\r\n'),
('410', 'I have been attending church with you all for a couple of Sundays now. I\'ve been here in Orlando for about four years now. I am currently pregnant with my first child and I will be interested in any open working positions you all may have available the first of the year 2014. Thank you.'),
('513', 'Sons and Daughters\r\nPart 3\r\nLuke 15:25-32 (NIV) \r\nMeanwhile, the older son was in the field. When he came near the house, he heard music and dancing.  So he called one of the servants and asked him what was going on. \r\nYour brother has come,\' he replied, \'and your father has killed the fattened calf because he has him back safe and sound.\'  The older brother became angry and refused to go in. So his father went out and pleaded with him.  But he answered his father, \'Look! All these years I\'ve been slaving for you and never disobeyed your orders. Yet you never gave me even a young goat so I could celebrate with my friends. But when this son of yours who has squandered your property with prostitutes comes home, you kill the fattened calf for him!\' \r\n\"\'My son,\' the father said, \'you are always with me, and everything I have is yours.  But we had to celebrate and be glad, because this brother of yours was dead and is alive again; he was lost and is found.\'\" '),
('633', 'I\'ve worked in many offices of many different types, and am a very flexible person.  After the second time I was laid off in 2010, I formulated a plan to go back to school and update my computer skills which I did.  I graduated from Westside Tech in 2012, with an \"A\" average, from the Medical Admnistrative Specialist program.  I have not found anything yet in my field, and am open to \"General Office\" positions, which I\'ve worked most of my life.  I love your broadcast in the mornings and you have truly been an inspiration to me.  I would feel honored to work for you and the Lord if even only part time.  If you have any office needs, please contact me to discuss my experience and skills.  (I learned Excel, Power Point, Access in school, and furthered my knowledge in Word.)   Thank you so much for everything, and for reading this.  I have many professional references available I can also email you. '),
('703', 'Hello to whom this may concern. I\'m a new member and I\'m in a bind to where Im short $250 , as of today. And I currently have$ 500.00. If the church will trust me to pay back the $250 on this Friday 11/5/2013. I really dont want to face an eviction , please if you can help me.'),
('708', 'Hello. My name is Judi Travers and I am writing this email to inquire about possibly getting some assistance. My husband and I have a one-year old son and we live in Orlando. Our son has had some respiratory issues since he was a few months old. He came down with a severe case of pneumonia a couple months ago and was hospitalized for over a week with it. Since my husband and I did not have adequate vacation or sick time accrued to cover the time off, I was forced to take time off without pay to stay with him while he was in the hospital and also to care for him at home after being released. I am happy to report that he is doing well and continues to make great strides in the recovery process.\r\n\r\nBecause of this unforeseen and unfortunate incident, weve experienced a financial hardship and we have fallen behind on our rent. As a last resort, we are reaching out to area churches to see if there are any emergency/benevolence programs available to help us get caught up. Can you please tell me if your church is in any position to help non-members with such requests? We know that you probably are overwhelmed with requests similar to this, but any help you can offer us would be greatly appreciated. We are behind $400 and we realize this is a lot of money and with the economy the way it is, we know it may be difficult to come up with that much money all at once, but like I previously stated, any amount you might be able to help us with would be greatly appreciated and would ease some of the stress we are currently enduring. \r\n\r\nThank you and I look forward to hearing from you.\r\n\r\nSincerely,\r\n\r\nJudi\r\n'),
('790', 'I\'m new here in Florida I been to different churches and I have seen you few times in tv and I feel the need to attend your church and I need to know how to get to your church , I\'ll be taking the bus cause I have no car , I live on 436 & 1792');
