INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('7649', 'I just would like to thank River of life for welcoming me in with open arms, My name is Whitney Mathis I am the mother Of Mahogany and Zion I was invited by my god mother and since then I have continued to come not just for her inviting  me but because of the personal relationship Me and our God has as he speaks confirmation through now my pastor, Pastor Jackson. Soon as I step in the church I just knew this is where I needed to be, I have been to many churches which each one I came out with something from God but still couldn\'t settle there until I came to river of life which God just spoke through worship services and also through Pastor the time is now you settle here because you have work to do. I am now walking in my healing and seeking after Gods heart and his will so where he place me I will go, What ever my calling is that I don\'t understand as of Now But I will do I say all to say ,The time is now where I have step out on faith with my wings spread out to do what God Has called me to do. And it will not only be in the church but also in the community that I will win others to Christ because its not only about me its about Shining my life that 1,2,3, or more be saved. Please keep me, my kids, and also my family in everyone prayers. Amen'),
('7673', 'My Question is What does it mean to give to GOD as far as 10% , How do i give to GOD? What does that mean?\r\nDo I give the 10% to the Church Only or do i use that 10% for Both the Church & Charities \r\n\r\nThanks'),
('7736', 'My child (son) joined church today and would like to be baptized on August 27th. Please advise if he will be able to baptized. My son spoke Dr. Jackson and he said he would baptize my son. Please advise.\r\n\r\nGod bless \r\nRhonda Cooper'),
('7829', 'I am a Christian and a mental health counselor who is registered with the state of Florida; which means I am working on meeting my 1500 hours towards licensure.  I already achieved the masters degree in counseling back in 2011.  Long story short, ever since I graduated I have been running into road block after road block when applying to various agencies to complete my clinical hours.  I just could not get a job as a counselor.  I finally land a job at a counseling agency that had me doing 60% psychoeducation and 40% psychotherapy.  Well, psychotherapy is what is observed by the state towards licensure hours.  Knowing that;  I took the job anyway with a mutual understanding that a clinical supervisor would supervise me and sign off on my psychotherapy hours; which amounted to 1000 hours.  However, as time went on the agency did not honor their part of the deal (because the clinical supervisor later stated that he was too busy to clinically supervise me) so I found myself stuck in a position where none of my work hours counted towards licensure.   In otherwords, I just threw away 1000 hours.   After one year I applied elsewhere for a counseling position.  I got the job and the lady put it in writing that she would be my clinical supervisor.  That made me happy.  So as weeks and months went on; the clinical supervisor starting becoming very bias towards me, she started sending me nice, nasty emails about what I better do, she started micro managing my every move and when another employee told a lie on me; she just assumed what the employee said was true and never once asked me.  When the truth finally came out; she made justification and rationale for why the employee would say that; instead of admonishing the employee and apologizing to me.  After 6 months of this treatment; I asked to speak with her to address my concerns.  I was very professional and calm.  She became very belligerent and just took what I said to the next level by drawing her own conclusions.  Finally, she stated that I had a choice of being terminated or I could just resign on the spot.  I tried to get her to listen to reason; but to no avail she would not; so unfortunately I had to resign 8/20/2014.  Of course, I am back out there looking for that counseling job once again; but I feel horrible!  I got an on the spot interview with another agency this morning; however, after this good hour and a half interview; the lady wanted to call the job I just had to resign from.  I was honest and told her about the situation, but she still wanted to call the job for a reference.   So of course, that does not make me feel any better.   I am counselor, but I can\'t seem to help myself.  I got the degree, but it seems as though the enemy is fighting me on every hand when it comes to getting those counseling hours towards licensure.   I know this was a little long; but I had to paint the picture.  PLEASE PRAY FOR ME!  I feel like I am having this horrible nightmare and can\'t seem to wake up.   I have no clue as to what is going on; because I am just not understanding.   I Thank YOU for your time and prayers.    Linda B.   :)   If you choose to call; between call between these times  9 am and 7 pm.  I thank you again!'),
('7853', 'The devil attacks those that are passionate seeking Christ not the lazy ones.\r\n\r\nDiscouragement starts mentally before it appears physically. Don\'t quit because someone is depending on you.\r\n\r\nPeter rebuked many times by Jesus.  The discouragements kept him afar. He denied Jesus 3 times and ran rather than overcome to fulfill the purpose God had for him.\r\n\r\nMatthew 16:21-22\r\nJohn 18:10\r\nLuke 22:54\r\nJonah 2:7-10\r\n\r\nALWAYS Pray. Don\'t stop praying. Remain steadfast, feel tired; do it anyway. \r\nKeep on serving. Keep on doing the right thing.\r\n\r\nHebrew 10:35\r\n\r\nDONT GIVE UP!\r\n\r\nPRAISE YOUR WAY OUT OF YOUR PREDICAMENT\r\n\r\n'),
('7866', 'Dear Pastor, \r\n   My family and I are new to the neighborhood and attended your church  for the last two Sundays and enjoyed your services much.  We have gone thru a strong trial and have been looking for encouraging words. My spouse  and I  literally just moved to a new apt happy that a door finally opened for us after literally being homeless  with the  kids going  now that we moved I lost my job which hit us out of no where it was our only income now we are just praying that I find a job asap to continue income for rent and food we have no transportation we literally have been hitting rock bottom. We heard your service of not quiting and keep fighting because God knows I\'ve been wanting to give up on everything because things just been spiraling down a stair way with no way to stop. Please keep praying for us I have interviews this week in hopes of having income again for this coming month rent Praying for open doors and our life to stabilize and stand firm in faith. Thank you I\'m a chef with associates in culinary arts if any work you know of please inform me will greatly appreciate it..'),
('7877', 'Prayer for Elena\r\n\r\nPrayer for financial breakthrough\r\nGod will supply all your need according to his riches in glory.\r\nGod confirmed His Word to deliver us, revitalize and strengthen the Word for the glory of God.\r\nThank you very much!\r\nGod bless you!'),
('7910', 'There are some things God tries to kill in you but you won\'t let it die. \r\nYou have to decrease to increase.\r\nGod designed you to be in a crushing situation to lift you.\r\nPraise Him in the storm. \r\nEveryone will have crushing moments but we need to prevail and find our  inner peace deep inside.\r\n The storm will be around. It did not disappear but it is in retreating to our peaceful place that we state that God has this.\r\n Don\'t stress, worry, get anxious. Be in peace and wait for change to come. \r\nWe have an appointed time for our storms to end.\r\nChange is on its way!\r\nYou are an overcomer!\r\nGod does not let anything happens that He has not designed.\r\nThe devil had to ask God permission to test Job'),
('7912', '2 Cornthians 4: 7-10;16-18\r\nThe Over-comers Mindset:\r\n~people that are victorious, weather the storm, ppl who see there season change & their turnaround manifest, they think a certain way. \r\n~We are not to be conformed of this world, but their are transforming power in the word of God.\r\nTornado Alley ?\'s\r\n1. Why would you build a house in an area that is designated as tornado alley?\r\n2. Why rebuild, if destroyed in the area?\r\n~Something in the child of god that causes us to BOUNCE BACK from adversity; try again.\r\n~Don\'t allow ONE bad situation to take you OUT.\r\n~The spirit of an over-comer is on the inside of you.\r\n~We will always WIN\r\n~More Than A Conqueror\r\n~Hold On TO god\'s Unchanging Hand, wait, and watch god Do what he is going to do in you life.\r\n~Key to Winning is Outlasting, Do not FIGHT with it, nor struggle with it, Roll With It. Trust in God to Deliver you.\r\n~The reason you are tired and spiritually exhausted, is b/c you are fighting a battle that God NEVER intended you to fight\r\n2 Kings 7:3-7\r\n2 Cor Passage Reading\r\n-Outward Man vs Inward Man\r\n-outward perishes and Inward renews\r\n~\"Light\" affliction: what you are going thru is working \"FOR\" you.\r\n~There are some areas of spiritual grow & maturity that you will NEVER grow in & mature in unless you go thru certain situations. It is God\'s will that we grow & develop. And we cannot do these thing, spiritual muscles cannot develop unless you go thru thing that are designed to build you up spiritually.\r\n~As in regular muscles work out, to then recuperate, and are then build back stronger than ever.\r\n~The enemy wants to knock you down, but YOU must come back STRONGER.\r\n~The trying of your faith worketh patience, but let patience have its purpose worked.\r\n~You got to go thru some stuff to get some spiritual muscle, and all you can say God will PROVIDE.\r\n~It is HE that has made us and not we Ourselves.\r\n~When you are focused on what God has called you to do, you don\'t have time for the peanut gallery.\r\n~One of the reasons a whole lot of ppl get distracted is b/c you are so busy watching what others are doing, you lost focus on what God has called you to do. \r\n~No man can receive ANYTHING, except those thing that GOD has designated that you ought to have.\r\n2 Cor 4;18\r\n~Ever pray for someone and they start acting crazy (deploy of the enemy), its designed to distract you.\r\n~Walk by FAITH and not by SIGHT; HOLD ON AND KEEP BELIEVING GOD; You cant look at what you see; \"Fixed Focus of Faith\", you have to believe god is doing it even when it doesn\'t look like he is doing it.\r\n~When God is doing something in your life you cannot be distracted by what you see happening around you b/c many times what you see happening around you is nothing more than a distraction to move you away from the PROMISED.\r\n~Stop retaliating, stop fighting, the reason why you are so tired and spiritually exhausted is b/c you are trying to fight a fight in the flesh that can only be won in the spirit. TRUST GOD IS WORKING OUT THE SITUATION!!!!\r\n\r\nReasons Why YOU Can Not Quit:\r\n1. Whenever God creates something, he puts something that is innately characteristic to that thing on the inside of it, & b/c it\'s designed a particular way, it functions even though it shouldn\'t have functioned.\r\n2. When the spirit of God is on the inside of you, & you have been born again of the spirit of God, & adversity comes in of your life, there is something on the inside of you that will not let you ROLL OVER and DIE & GIVE UP b/c GOD has put the spirit of a VICTORIOUS PERSON on the inside of you.\r\n\r\nRomans 8:35-39\r\n\r\n~God NEVER promised Christians that we will be immune from the vicissitudes of life.\r\n~Life happens!!!\r\n~Not everybody that smiles is happy, sometimes ppl smile simply b/c they are strong. You\'ll be surprised what is behind their smile. They smile b/c they are conquering.\r\n~RESTORATION!!!!!!\r\n~DAVID said : Wait, wait on the lord, and while you wait watch your attitude; while you wait be of good courage.\r\n~God\'s Got This!!!\r\n\r\n2 Cor 4:7\r\n~You didn\'t make it thru, HE brought you thru. \r\n~If only you knew what God has placed inside of you. He has placed a treasure inside a fragile container.\r\n~People misjudge you b/c they look at your exterior but they don\'t know about the power of your God that is living on the inside of you & when they jumped on you, they should have left you alone.\r\n~There are some great things that God is ONLY going to do in your life after you \"DIE\".\r\n~There are some things that God is not going to do in your life, there is a power of God that isn\'t going to be displayed in your life until you \"DIE\"\r\n   Ex: Pride, Selfishness, Unforgiving, Always wants Remote themselves\r\nAnd when God kills all of that, that is when the real you comes out \"The Hidden Man\" he is something to be reckoned with.\r\n~But some of the battles that you continue to lose is b/c there are things in you about your character, attitude, personality, their are somethings that God is trying to KILL but YOU won\'t let it DIE.\r\n~Certain storms are designed to crush YOU.\r\n~Too much of YOU; You have to decrease so GOD can INCREASE.\r\nGarden of Gascinomy- olive garden; crushing, pressing\r\n~The anointing that is in you is not going to come forward until you go thru a crushing experience, & it is that crushing experience that will change how you pray.\r\n~ God had allowed you to be in a situation that was designed to crush you, so that a new YOU can be resurrected. Personal Crucifixion. \r\n~You are not going Under, You are Going Over; training for reigning.\r\n~Whatever you are going thru has a \"start date\" & a \"stop date\", which has already been determined by God.\r\n\r\nJob 14:14\r\n- Job was the greatest man of the East but God allowed the enemy to test him; but he kept on praising God \"appointed time\"'),
('7922', 'Could you post Dr. J\'s message 14-42-01 series online? I overslept this morning & only caught the last part of it. I do not miss his messages on GoodLife TV every morning. \r\n\r\nWhere the heck did this guy come from? I stopped going to churches because they did not preach this way ... like it or not ... I live too far away to visit but his messages have set me free in many areas & he is a confirmation to me in those areas. God Bless Dr. J!');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('7984', 'I wanted to know if your ministry has any further teaching or resources available about marraige.  I enjoyed Sunday\'s teaching very much and would like to learn more. I am single, but in talks of marraige. I would like to possibly learn more about conflict resolution, dealing with in-laws who overstep boundaries, communication, and/or finance. Ultimately, I\'d appreciate any material/resources your ministry may have geared toward marraige and having the right perspective in a biblical sense. '),
('7996', 'Hello,\r\n\r\nI am an in-home caregiver.  My preference is to volunteer for the 9 am service.  However, I will make every effort to serve when I am most needed.  Looking forward to it!  Thank you.  Geri\r\n\r\n'),
('8018', 'When God Judge A Nation\r\nPsalms 89:14\r\nHosea 4:6\r\n2 Peter 1:3\r\nJonah 3: 1-2\r\nGod is a God that Judges sin......\r\nLam 2:22\r\nMust have a reverence for God!!!!!!!\r\nYou better get your own oil.......(bridesmaid @ wedding)\r\nLam: 5: 1- 5 meaning of word )what has happen to us, 2 a lot of things not own b Americans, selling ourselves out 3 fatherless, provides and protects, Godly man is needed, do what you see kids, 4 we have to buy our water and things that use to be free, 5 instead of 1 have to work 2-3 jobs to make ends meet, no rest.....Could God be judging a Nation/ America \r\nRomans 1: 18-28  19 when you look at yourself you gotta know its a God, 20 clearly seen: ex sunset, the things God has made (nature),\r\nWhen you don\'t provide for your own your are a \r\nLove the person but not love the sin!!!!!!!!!\r\nSometimes you need to praise God for what he did not allow to happen.......\r\n2 Chronicals 7:14 Pray will change things, seek his face; fasting... \r\n\r\n'),
('8107', 'The last three Sundays it\'s been so cold I\'ve really been miserable.  I have a condition called raynauds and  I wear gloves for my hands.  Everything has been great all year, so it\'s only been the last 3 Sundays.  I\'d love to be comfortable at my church.  I really don\'t like complaining  and I hope all will be alright.       Thank you!'),
('8205', 'To whom it may concern:\r\nI have been a member of the church since 2009 I believe and currently serve on the ushers and greeters ministry.  I am not sure if pastor still meets with church members, but I am struggling with an issue and am trying to overcome it.  It is dealing with forgiveness, and I feel like I am hindering myself until I am able to overcome this.  I am desperately trying not to turn to bitterness (it has been over a year).  I do study the word, but am failing to put it to use.  Is there anyway possible that I would be able to meet with Pastor Jackson or maybe even Pastor Deborah for some council/advice?\r\nThank you!\r\nJoelle Kozik'),
('8211', 'I really would like to pray.. i feel berry discourage... its going to be almost a year of my divorce... and he had keept everything... my financial are dificult... and the pain don\'t seem to go away... \r\nThanks '),
('8234', 'Subject: \r\nFormation of a Life-Group at ROLCC for Families that have Children with Special Needs\r\n\r\nProposal B1DSP: Offer to Render Services to assist in helping ROLCC select Sensory and \r\n                          Occupational Therapeutic Future-proofed Technology, Resources and Design  \r\n                          Elements and Ergonomics during their Building Expansion Project and to    \r\n                          include Resources and Technology aimed at Accommodating Families that have \r\n                          Children with Special Needs. \r\n\r\n\r\nTo: Pastors Marvin Jackson & Deborah Jackson\r\n       Lead Pastors at The River of Life Christian Center in Orlando, FL\r\n\r\nFrom: Ryan Council, President & Founder of Breathe 150 Entertainment\r\n\r\n\r\n\r\nForming a Life Group for Families that have Children with Special Needs\r\n\r\nTracey and I appreciated the opportunity to meet with you both the other day and are thrilled with the idea of a life-group being developed at ROLCC for families that have children with special needs. We think that it will be a wonderful way for families like ours to connect and to build relationships with other families in the Central Florida area. Its not easy trying to raise children that have development delays or severe autistic malformations. Though it takes its toll on parents, the children are the ones that suffer the most because it is assumed that they cannot interact with others or enjoy the things that most of us doand those things that we take for granted. We commend you both on your wisdom and direction on being willing to initiate this life-changing community resource for the members of ROLCC and for those also in the Central Florida area.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nProposal B1DSP: (UNOFFICIAL PROPOSAL) \r\n\r\nPlease understand that this section of the document below is NOT an official contract or agreement to offer services to the River of Life Christian Center in Orlando, Florida. This section under the heading titled Proposal B1DSP- (Breathe, 1st Draft, Special Needs, Proposal) is simply a written offer to be submitted to Pastors Marvin Jackson and Deborah Jackson. This letter in its entirety with specifics to this section titled Proposal B1SP does not hold Ryan Council, Tracey Council, Ph.D., or Pastors Marvin Jackson and Deborah Jackson under any legal obligations to accept or to follow through with the offer written therein. It was drafted ONLY to submit an offer to Pastors Marvin Jackson and Deborah Jackson.\r\n\r\nTaking your advice from out of our meeting the other day concerning our business                  (Breathe 150 Entertainment) and our upcoming conference, Tracey and I have discussed some varying opportunities, that we believe could be mutually beneficial to both Breathe 150 Entertainment and to The River of Life Christian Center. I am currently in process of putting together an OFFICIAL PROPOSAL that will be titled Proposal B1SP and it will be very specific in outlining all of the details of all of the events and opportunities that I am proposing. \r\n\r\nUnofficially, I would like to offer my services to ROLCC that will be detailed in an official document titled: Proposal B1SP. I understand that ROLCC is in the process of a building expansion with a focus point on designing a room(s) that can accommodate sections for the growing needs of children during worship services. As per our discussion, you both understand those needs within the Central Florida community and particularly within the ROLCC family for churches to begin to provide resources for families that bring their children to worship services and especially for those that have children with special needs. The services that I would like to offer you should help as you make preparations within the scope of the building expansion.\r\n\r\nSince I am a father of a child that has special needs, I understand what parents are looking for when it comes to accommodations, resources, and technology that children need, especially when they have development delays. Ive made connections within the medical and educational community that most parents dont get a chance to make because their children have not been repeatedly in the hospital; their children have not had to have surgery; their children do not have to be in a special education program. Unlike most, I am comfortable with saying that I have an advantage that could be beneficial to the ROLCC community. Besides that, I spent a great portion of my career networking with and working alongside of CTS-certified audiovisual design technicians; and I spent 5 years leading an AV redesign for a Fortune 500 marketing advertising company that was completed upon me relocating to Georgia. I played the central part in negotiating and re-designing training and conference rooms for the corporate headquarters of an international company and I was the lead technician for all of their broadcasts and recordings. My recent Entertainment Business degree helped me to better understand how to function in a business world and to understand that money is not limitless. It has reshaped my thinking and I believe has prepared me to function practically when needing to make conscious decisions.\r\n\r\nSo again, I would like to offer my services. Those services would include handling the details of acting as a co-project manager for the section of the expansion project for a special needs family area/room pertaining to: \r\n1. Creating a timeline,\r\n2. Gantt Charts, \r\n3. Creating presentations for ROLCC administration, \r\n4. Working with AV designers (contracted and sub-contracted personnel) as the project moves along for the section(s) pertaining to a special needs family area/room\r\n5. Working with educators, occupational and physical therapists in the design/bid process on what materials, resources, and technology we should integrate into the ergonomics of the design, 6. Reemphasizing and assisting with mentoring the staff and the ROLCC community on creating an inviting atmosphere for families that have children with special needs,  \r\n7. Submitting budget requests,\r\n8. Keeping the project on budget,\r\n9. Keeping the project on time\r\n\r\nPlease understand that I am not in support of or an advocate for simply designing a room to sequester families away that have children with special needs. Though I understand the demand and importance of maintaining an atmosphere where quality broadcasts and recordings can take place within the sanctuary, the idea of corralling families into a room because of the dynamics of their family falls under profiling and stifles the worship experience and spiritual growth for those families (please see the linked article:\r\nhttp://www.lifenews.com/2014/08/25/the-hardest-place-for-us-to-take-our-special-needs-child-our-church/). \r\n\r\nOur goal within the aspects of our business and our personal mission is to re-shape the ideas, attitudes, and worldview of the Christian church community when it comes to individuals that have special needs. We hope that you will support us in this mission.  \r\n\r\nFor your consideration, Ive attached my LinkedIn Profile for your review of my skill set:\r\nhttps://www.linkedin.com/pub/ryan-council/2a/a87/9b5\r\n\r\nI hope that you will find me to be a resource that you can utilize for the growing needs of the ROLCC family. My offer is NOT a request to take over someone elses current role in the church. It is an offer that I plan to attach with favorable conditions (for both my company and for ROLCC in pertaining to our inaugural conference in 2015) moving forward as I outline the details within the official proposal to be submitted to you by next week (based upon your response to this unofficial proposal). Please feel free to get in contact with me if this unofficial submission deems to be favorable to you both. *As I am sure you do as well, I always sit down with my legal aid when drafting up official contracts and documents, and I hope that we will be able to do so as we move forward from here. Thank you and God bless.\r\n\r\n* Legal aid reference and the suggestion of utilizing them helps to keep me on task and not to violate the business relationships that I come into contract with. It is my hope to utilize them (if we are somehow able to do business with each other) so that you can continue to lead me as my pastoral covering and that no dissention arises to break up the church community in which we are enjoying. Every effort (both in business and in private in regards to me and my family) will be to preserve the church fellowship that we have.   \r\n        \r\n\r\n     \r\n\r\n'),
('8263', 'I am the new manager of your locally owned and operated Domino\'s Pizza...I would like to become more involved in our local community and one way is through connecting with local churches.  I would love to meet or speak with someone regarding the specials we now have for churches and church groups.  Hope to hear from someone!'),
('8264', 'Take notes here, then email them to yourself by clicking below.\r\n10/5/14\r\nPursuing God\'s Best\r\n\r\nDeuteronomy Ch 28: 1-14\r\nJoshua Ch 24: 14-15\r\nMatthew Ch 7: 24-27 (House on Rock; House on Sand)\r\nActs Ch 10: \r\n\r\n'),
('8289', 'Please pray for Mickel Brown, at Halifax hospital in ICU intensive care unit on life support .\r\nPlease pray that Gods power show up and completely restoration him.  \r\nFor his son Mikel Jr. and Matthew \r\nhis  Mother Ms. Williams for Salvation wisdom strength and direction for the family\r\n\r\nThank you,');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('8301', 'Lee and I soliciting the sincere and fervent prayers of our church family for a complete revealing, exposing, removing of anything that\'s not of God and healing for Lee. We denounce any and all words or diagnosis of any type of frontal lobe (cognitive) dementia or any other brain issues. We do believe that the prayers of the righteous availeth much. In Jesus Name Amen.'),
('8328', 'Wait on the Lord. While you are waiting, do not wander. Wait and still praise Him. Wait and still go to church. Wait and still do good. Wait and still believe that God will see you through. Stay in the word because there is comfort in the word of God.\r\n\r\nWrite off the words that are not comforting, uplifting and encouraging. People will cause you to stress.\r\nDo not worry about your haters, while God is comforting you. Isaiah 51:12-13\r\n\r\nIsaiah 43:19 \r\n\r\nGod comforts us with His spirit. He brings you peace.\r\nGod comforts you through other people. God sends the right people to you.\r\nGod comforts you in His word. Read the bible. There are stories of people in the bible who went through rough times, God carried them through.\r\n\r\nGod already has a plan for you.\r\n'),
('8374', 'Good evening, Pastors Marvin and Dr. Debra Jackson:\r\n\r\nI\'ve missed the last two services because I got called into work, but I called in and left a message for you on the previous Sunday when you were scheduled to make an announcement about developing a life group for families with children that have special needs. I also submitted a draft proposal as you requested. I wanted to make sure that we had a chance to talk about it when you were ready. There\'s a lot of detail in that draft that I would like to simplify and I think that it would be best simplified in person. I promiseno power-point presentations this time :) \r\n\r\nPlease let us know when your schedule is open for another brief conversation if you would like. We took your feedback from our previous discussion and have really trimmed a lot of the fat out of the vision for our business. We look foreword to speaking with you soon. Thank you.\r\n\r\nSincerely\r\nRyan Council\r\n757-339-7965'),
('8380', 'I have supplied a brief testimonial in regards to my background and experiences. I truly believe with my wealth if experiences, background and education I can fulfill any position... I can provide references and any other related information.'),
('8394', 'Good morning,\r\n\r\nPastor Jackson indicated towards the end of service that we could ask him for his notes of yesterday\'s message (10/15/2014). I would like to know how would I go about requesting them?\r\n\r\nThank you,\r\nKia Anderson'),
('8412', 'I was recently diagnosed with colon cancer and on Wednesday, October 22, I am scheduled for surgery to have the cancer removed. The procedure is an resection of the intestine. I am requesting prayer for a successful surgery and to be totally cancer free once its removed with no need for chemo after. Thank you.'),
('8413', 'God expose, remove and reveal anyone that is not to be on my journey. God\'s purpose is not for everyone in your life.\r\nStop trying to fit in when God has called you out.\r\nWhen God speaks to you it is for you. Be caeful who you speak to about God\'s message for you because some people will try to mess you up on your journey.\r\nTime proves all things. Whoever is inyour life, time will reveal who they really are.\r\nWilderness is a humbling place. The wilderness is where you remember eating only rice and green peas puree, having no meat. Wilderness is being in a place that humbles you, where you did not have much but you made it through as part of your journey.\r\nMost people will hate on your glory when they did not your story\r\nDeuteronomy 8:2\r\nAppreciate your journey because God is trying to take you somewher new and is getting you ready for it now\r\n'),
('8417', '11am service Oct.19, 2014 Notes\r\n\r\nExodus 13:17-18\r\n\r\nIn order for God to increase, I have to decrease. God has to be magnified. I have to be stripped of what I am holding on to so I can go where God has already prepared for me to be.\r\nGod has to purge you from people because they are not meant to go on with you in your journey.\r\nLearn to walk by myself. There are some journeys you will have to walk through by yourself.\r\nTime proves all things. God is calling you out. The reason why you still on certain journeys is because God is purging out what I am still holding on to (people, thoughts, traditions, ways...)\r\nGod will take you throuh wilderness.\r\n You will never appreciate your destination unless you learn to appreciate your journey.\r\nPeople don\'t judge you on your journey (all that you went through to get to where you are), they judge you on your destination (where you are now).'),
('8431', 'Topic: Pursuing God\'s Best: Faith for Divine Health and Healing\r\nWed Night Bible Study\r\nRiver of Life Church\r\n\r\nHow can I pursue the best possible relationship with God??\r\n\r\nHebrews 10:35 (Read this scripture!)\r\n\r\n3 John 1:2\r\nJeremiah 30:17\r\n\r\nThings that Make up Soul of Man: 1. Your Will  2. My emotions  3. My Thoughts\r\n\r\nSpiritual death is when are disconnected to God. You have to renew your mind with the Word of God and get another understanding of the purpose of our bodies.\r\n\r\nWhen purpose is unknown, misuse is inevitable\r\n\r\nRomans 12-1-2; 1 Cor 6:12-13\r\n\r\nThe body is for the Lord\r\n\r\n1 Cor 11: 29-33; We have been purchased with a price. Our bodies belong to God. Leviticus 11:9\r\n\r\n\r\n\r\n\r\n'),
('8433', 'Jeremiah 30:17- noetic effects of sin; the need for a revelation regarding our bodies and their purpose.  Renew your mind and understand your purpose- whenever purpose is unknown misuse is inevitable.\r\nRoman 12:1-2- present your body as a living sacrifice\r\n1 Corin 6:13\r\n2 peter 2:19\r\n1 Corin 11:29-33- \r\nLeviticus 11:9\r\nShellfish highest cholesterol content\r\npork- contains a lot of poison- very harmful to your body\r\nGod gives us free will to choose- but whatever harm your bring to your body is on your \r\n.   ');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('8454', 'Good evening, Pastor and Dr. Deborah Jackson:\r\n\r\nTracey and I hope all is well. We had to make the decision to postpone or at least push off launching our event. We just weren\'t able to pull in the support in the time frame that we needed it to be in. We\'re trying to work some other angles but it\'s just not coming together the way we would like. \r\n\r\nAnyway, I wanted to simplify the proposal that I sent to you. It was a bit over-detailed, but I wanted to make sure that I was as thorough as possible. However...to keep it simple...I just would like to have the opportunity to help ROLCC out if and when we are in a serious position to make a move on developing your ideas for a family life center, interactive play rooms, and anything dealing with future proofing the facility to accommodate families with children and those that have children with special needs. The services that I listed in the draft proposal was for no charge. I was trying to volunteer my services to the ministry. I\'m not looking to replace anyone\'s role on staff, but if you were ready to move in that direction, I\'m at your disposal to help. Have a great week. '),
('8455', 'Fix for faltering faith teaching. Oct 26, 2014 11am Service\r\nMark 9:14-30\r\nGod has allowed certain things in your life, to test you\r\nDon\'t stop waiting, don\'t stop believing.\r\nFaith involves sacrifice.\r\nCauses that falters faith: disappointment, time, sight\r\nDon\'t allow disappointment to cause your faith to falter Romans 8:28\r\nproblem is we are too fast, want a microwave blessing.God does not want you to get there too soon when it is not ready yet.\r\nLife is filled with disappointment.\r\nDon\'t allow your current situation to be your permanent situation. Devil will have you settle. devil is a lie!\r\nGod has a time to bless you.\r\n Genesis 17:21 Abraham and Sarah\r\nGod will teach you how to wait; anythin that is premautre is defective\r\nStory of Balaam and the donkey\r\nSight will mess you up. Your faith will alter with what you see sometimes\r\nYour breakthrough is just around the corner. Don\'t stop!\r\nGod will bring you into it little by little until you cn possess it, own it.\r\nHow are you handling your blessings right now?\r\n\r\nDon\'t worry about time. Every delay is working for you in favor. \r\nWalk by faith and not by sight.\r\n\r\n\r\n'),
('8461', 'Pastor Jackson,\r\n\r\nI try to watch your program every morning on TV 45 because I enjoy listening to you. This morning (10/29/14) you talked about how God wants us to prosper and you talked about tithing. I have a question concerning tithing. I\'m retired from the Navy and receive a retirement from the DOD plus I also receive a small disability from the VA. The disability I receive from the VA is taken out of my military retirement along with taxes and medicare and then the VA turns around and gives the disability to me. For instance say I get $100 from DOD for my retirement and they take $10 out of it because of my disability and the VA turns around and gives the $10 to me for my disability do I tithe on $100 or $110?\r\n\r\nI ask because I want to make sure that I am giving God His full share. \r\n\r\nThank You,\r\n\r\nJohnnie'),
('8526', 'Healing for Hidden Hurts:\r\nMark 3:1-6\r\nJesus came to heal whole body (spirit, body, mind)\r\nLuke 4:18\r\nJehovah Rapha- God our Healer\r\nThings happen to people in their past to make them act the way they do now (prior hurts)\r\nExample, a man or woman that goes from bed to bed, because something happened to them such as, their father was either not there in your life or abusive in your life\r\n1. Your pain has to be properly diagnosed--John 9:1-2\r\nMatthew 7:3-5\r\nJohn 4:\r\n1-Healing starts with the Word of God, He will speak to you and send His Word and heal you\r\n2-Stop beating yourself up and forgive yourself (Romans 8:1)\r\n3-Maintain a healthy heart and renew a right spirit (2 Samuel\r\n'),
('8528', 'HEALING FOR HIDDEN HURTS\r\n11/2/14\r\nNotice pushing people away due to hidden hurts...dont function properly, dont want to attach to small groups and only go to church and go home. Need to deal with reason for the hurt or negative patterns will continue...why do people have to be the center of attention? People shut down and stop loving due to prior hurts...\r\n1. Pain has to be properly diagnosed-usually misdiagnosed (John 9:1,2) People will look and try to diagnose others....need to work through your own issues. (Matthew 7:3) Be careful of folks trying to help you fix your situation...Only the holy ghost can tell you whats wrong with you...Ever wonder why you eat when your not hungry, why you need to be acknowledged or thanked...etc. If you understand that you can change some things in your life (John 4). Why do u go from one conquest to another and feeling like a conqueror...prince don\'t do that and once you get the revelation you will get it. Maybe you had a father wound. Missing or abusive daddy when u were younger and repressed the issue and now a grown man and havent made the connection. God is an awesome surgeon, he will work on your heart and stitch you back up, whole. Sometimes you end up paying for what someone else did. \r\nSometimes you can\'t please people, stop dealing with people from your place of heart. I God\'s eyes you are loved. Stop trying to please and live for others. Be the best you can be...you will never please people. \r\n\r\nGod sees us at a level we don\'t see ourselves. Sometimes those that look the part are the most broken people. You get in a relationship because of the packaging and not the content...Yeah she is fine but she is messed up racheted, Yes he is fine and has money and he also has a temper and likes to beat women...especially you.\r\nProdical Son celebrating when he came home and you would think his brother would celebrate, but he wouldn\'t go in to celebrate. Why do we have envy in our lives...we get upset jealous, dissmissive...all ungodly feelings. Most stuff you are envious of you wouldnt be able to handle if you had them anyways.\r\n\r\nJesus wants us to be free...wants to erase all the pain, bad memories, get you to the point where you can forgive and let things go. When you have hurt and pain, it only affects your life and the other person isn\'t even thinking of you. Cant be happy in your home because of the hurt someone else inflicted on your life.\r\n\r\nHealing begins with the word of GOD. Don\'t wait til you get to church...Read your bible. The holy spirit will speak to you. Make it a daily habit. It is designed to bring healing to our pain. Stop beating yourself up! Set yourself free, forgive yourself (Romans 8:1) Therefore there is no condemnation for those who are in Christ Jesus that do not walk according to the flesh....\r\n\r\nMaintain a healthy heart..(Davids prayer, create in me a clean heart...) (2Sam 12:9)David sent the man and told the soldiers to put him up on the wall and the man was killed...David set him up. We have set some things up...hotels, people, etc. \r\n\r\nDealing with stress causes you to yell at others when you not upset with them. Stop taking out the pain on innocent people that had nothing to do with the issue.\r\nPsalms 138:8- I\'m God\'s creation and he says he will not forsake the work of his own hands. Have to admit we have jacked up ways.\r\n'),
('8530', 'Take notes here, then email them to yourself by clicking below.\r\n\r\nHealing for bidding hurts:\r\n\r\nMark 3:1-6 NKJV\r\n\r\nSTUFF INSIDE OF US THAT KEEPS US FROM BEING WHOLE. THE CHURCH IS A RECOVERY ROOM FOR PEOPLE THAT ARE HURT.\r\n\r\nWHAT ABOUT WOUNDS THAT CANT BE SEEN LUKE 4:18\r\n\r\nChurches are full of people with bruises that are being masked- hidden hurts...we sometimes hide them so much people can\'t see, but our behaviors display a hurt! Ex. Got hurt in a ball game you favor that side a few days later someone comes to you and ignites the pain on your hurt leg and you push them away not b/c they did anything, but b/c you don\'t want them to reinjure your internal injury but the other oerson didn\'t know there was an injury at all!\r\n\r\nJesus came to heal our hurts- people shut down and stop loving they are not free.\r\n1) pain has to be properly diagnosed\r\n    John 9:1-2 blind from birth \r\n    People want to diagnose your pain and haven\'t done anything to help their pain\r\n    Matthew 7:3-5\r\n    Before you can tell me you need to fix yourself\r\n\r\nJohn 4\r\n\r\nA father wound- when your father is absent or abusive\r\nThe Holy Ghost is a surgeon without a knife\r\n2) stop beating yourself up- think about things we have done and kick ourselves for being so stupid-free yourself\r\n\r\nRomans 8:1\r\n\r\n3) maintain a healthy heart\r\n2Samuel 12:9\r\n\r\n4) trust God to fix your life\r\nGod said he will not forsake what he made\r\nPsalms 138:8\r\n\r\nNeed to commence yourself to the one who made you\r\n\r\n\r\n'),
('8557', 'Take notes here, then email them to yourself by clicking below.\r\n\r\nDon\'t wait on others to affirm me. \r\nEncourage myself in the Lord. \r\nSpeak positive words over myself every morning. \r\nPay attention to the words I speak over myself. \r\nCall things that be not as if they exist. \r\nBy controlling what comes out of my mouth, controls what happens in my life. \r\n\"The Lord shall increase my greatness and great shall be the peace of my children, \r\nand comfort me on every side.\"\r\n\r\nPsalms 45: My tongue is the pen of a ready writer. \r\nEzekiel 37:\r\n\r\nJeremiah 30:17 For I will restore health to you. and heal you of your wounds,\' says the Lord. \r\n\r\nProverb 18:20  a man\'s stomach shall be satisfied from the fruit of his mouth; From the produce of his lips; he shall be filled. \r\nDeath and Life is in the power of the tongue. \r\n\r\n\r\n\r\n\r\n'),
('8559', 'Take notes here, then email them to yourself by clicking below.\r\n\r\nHealing for bidding hurts:\r\n\r\nMark 3:1-6 NKJV\r\n\r\nSTUFF INSIDE OF US THAT KEEPS US FROM BEING WHOLE. THE CHURCH IS A RECOVERY ROOM FOR PEOPLE THAT ARE HURT.\r\n\r\nWHAT ABOUT WOUNDS THAT CANT BE SEEN LUKE 4:18\r\n\r\nChurches are full of people with bruises that are being masked- hidden hurts...we sometimes hide them so much people can\'t see, but our behaviors display a hurt! Ex. Got hurt in a ball game you favor that side a few days later someone comes to you and ignites the pain on your hurt leg and you push them away not b/c they did anything, but b/c you don\'t want them to reinjure your internal injury but the other oerson didn\'t know there was an injury at all!\r\n\r\nJesus came to heal our hurts- people shut down and stop loving they are not free.\r\n1) pain has to be properly diagnosed\r\n    John 9:1-2 blind from birth \r\n    People want to diagnose your pain and haven\'t done anything to help their pain\r\n    Matthew 7:3-5\r\n    Before you can tell me you need to fix yourself\r\n\r\nJohn 4\r\n\r\nA father wound- when your father is absent or abusive\r\nThe Holy Ghost is a surgeon without a knife\r\n2) stop beating yourself up- think about things we have done and kick ourselves for being so stupid-free yourself\r\n\r\nRomans 8:1\r\n\r\n3) maintain a healthy heart\r\n2Samuel 12:9\r\n\r\n4) trust God to fix your life\r\nGod said he will not forsake what he made\r\nPsalms 138:8\r\n\r\nNeed to commence yourself to the one who made you\r\n\r\n\r\n'),
('8580', 'Good afternoon Pastor. Jackson:\r\n\r\nI am Josephine Marcellin, the executive director of Helping Hands with Love, Inc. I am also a member of the River. \r\nPlease call at 407.970.9331 for an update of the ministry in Haiti. Looking forward to hearing from you.\r\nUntil then, may joy and peace of our Lord Jesus Christ rest upon you and the entire church family.\r\n\r\nYour sister in Christ,\r\nJosephine'),
('8598', 'Hi ROLCC Family,  This message is for Pastor Deborah. I\'ve recently joined ROLCC,  and would like to pray with you in the Faith Fight for Families campaign.  Earlier this years our family was attacked and so many of those beloved to us, thereafter. Now, I thank god daily for our salvation; and I am truly a believer in the power of prayer. It has changed everything for us and I\'m certain it will do the same for so many others. Thank You for your leadership, your courage, and for all your prayers. I admire u so much.I love you too, Pastor Marvin. You are an excellent teacher. Your lessons are truly transforming my life. Keep doing what you do! #thebestfirstlady#christianpowercouple #GODISNOTDEAD#Happy Founder\'s Day..T.Chambers.');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('8642', 'Hello Pastors, \r\n\r\nI am a 15 year Orlando resident now living in Jacksonville, FL.  It seems to me that I am unable to get your tv program up here.  I don\'t know how it works but if you can get invited by a Christian tv network in Jax it would be an asset to the Jax, FL community.\r\n\r\nThank you.'),
('8665', 'I\'m writing on behalf of my sister, Xiomara Hickey.  She\'s in the hospital at the moment.  The doctors are having a hard time getting her blood pressure down, and her kidney function is low.  She\'s experience kidney failure, so they want to start dialysis.  I\'m asking for you all to please pray for her.  Thank you -Melodie Hickey'),
('8686', 'Praise Him, I have family that  lives in Orlando and I was watching your service on television. I will mention your church to them but in the meantime, this is a number ( Chris @ 1-321-663-6123).\r\n I enjoyed the sermon I listened to  this morning. \r\nGod Bless, and thank you.'),
('8692', 'City of Orlando\r\n\r\n\r\nCity of Orlando self Proclaimed Home of the City Beautiful\r\n\r\nBeauty is in the eyes of the Beholder.  Ladies and Gentleman our Florida Constitution has a Preamble that recognizes the Beholder as Almighty God.  PREAMBLE\r\nWe, the people of the State of Florida, being grateful to Almighty God for our constitutional liberty, in order to secure its benefits, perfect our government, insure domestic tranquility, maintain public order, and guarantee equal civil and political rights to all, do ordain and establish this constitution.\r\n\r\nSo how do you secure the benefits of recognizing Almighty God without promoting the belief that Jesus is the Creator held by Protestants? How do we perfect our government that our framer Benjamin Franklin recognized Nations rise and fall by the continence of Almighty God?  How do we insure domestic tranquality when 90% of Americans recognize a Creator God and every Constitution acknowledges His existence?  How do maintain public order by promoting and endorsing a theory of Communist and Atheist who believed in no Creator as the only truth over Academic Freedom? Finally how do guarantee Equal Civil and Political Rights to all by not allowing a Moment of Silence?\r\n\r\nWe know we have a Law in Florida that gives the Local County School District the right to open daily session with up to 2 minutes of Silence and it is a matter of choice in your hands in the presence of the eyes of the Beholder.  Our First Amendment Right says government will not make laws to prohibit the free exercise of establishing religion recognized with the words \"thereof\".  We have reconciled the matter in the Courts of Man with a Moment of Silence and the Academic Freedom to discuss a Creator God in the context of Classroom discussion.  We all have pledged an Allegiance to a Flag that represents a Country and a Nation under God and IN GOD WE TRUST.  \r\n\r\nI make my final plea for you to reconsider your action that has turned your professed beauty to an ugly sight in the presence of our God in Florida.  You are recklessly endangering the future generations by impairing the blessing that comes from recognizing the existence of Almighty God who sent Jesus that divides our Human History.  BC(Before Christ) and AD (Year of our Lord) is not religion but World History and withholding the evidence of our Intelligent Design and the accepted truth of the Big Bang Theory that defunct a Theory of Evolution in the Origin of the Universe and Man is a dereliction of duty to provide a 21st Century Education.  We have the irreducible complexity of our DNA not to continue to dumb down the critical thinking skills of children for a dogma of the Religion of Atheism through a Theory of Evolution.  I am prepared to stand before God and in the Courts of Man. Are you willing to waste taxpayer money and your life to keep our God out of the mouth of children?\r\n Revelations 4:2 And immediately I was in the spirit: and, behold, a throne was set in heaven, and one sat on the throne.11 Thou art worthy, O Lord, to receive glory and honour and power: for thou hast created all things, and for thy pleasure they are and were created. I submit to your wisdom the One who sits on the Throne begot Jesus and sent Him. Revelations 5:7 And he came and took the book out of the right hand of him that sat upon the throne.\r\nI am a man of my word and have a proven track record and God is Faithful to His Word. I changed the law in New Jersey because of my court filings and took the moment of silence out of the hands of the Local Board of Education and placed in the hands of Principals and Teachers. Revelation 22:12 \r\nAnd, behold, I come quickly; and my reward is with me, to give every man according as his work shall be.\r\nhttp://www2.ca3.uscourts.gov/opinarch/123068np.pdf\r\nDec 4, 2012 ... 12-3068. ______. EDWARD D. TORRES, a/k/a Rev. Eddie Torres,. Appellant v. SARA DAVIS, Board of Education of Camden Public Schools;.\r\nNEW JERSEY STATE LAWS -----------------------------------------------------------------------------------\r\n18A: 36-4. Period of silence\r\nPrincipals and teachers in each public elementary and secondary school of each school district in this State shall\r\npermit students to observe a 1 minute period of silence to be used solely at the discretion of the individual student,\r\nbefore the opening exercises of each school day for quiet and private contemplation or introspection. (L.1982, c. 205,\r\ns. 1, eff. Dec. 17, 1982 - UPDATED THROUGH P.L. 2012, ch.4, and JR 10 of 2011\r\nMay God Continue to bless you and your family as you move on this matter.  Ask not what the Kingdom of God can do for you but ask what you can do for the Kingdom of God.  http://www.gopetition.com/petitions/end-the-theory-of-evolution-as-the-only-truth-in-florida-public-schools.html\r\nAlways from the heart\r\nRev Eddie Torres\r\n5448 Nerissa Ln\r\nOrlando, Fl 32822\r\n407-267-2010\r\nheartofnj@gmail.com'),
('8698', 'Hi my name is Vanessa Leance just writing to say I have been in a backsliding state and I rededicated my life back to Christ onJuly 1 2014 and am homeless and without car I was wondering do u all have transportation I would love to come fellowship with u all my address is 5870 south orange blossom trail room 251.Yall Church Has  been tugging at my spirit. I pray its not to far.thank u blessings'),
('8715', 'The Importance of Set Place \r\n\r\nNumbers 9:15-23 - They never set out unless the cloud moved first. We have a problem with submitting with God; we want to ask the question why. It is not necessary for God to tell you why. He does not have to tell you why he does a particular a thing. \r\n\r\nDeuteronomy 29:29 - Being in your set place can determine the success of what God is trying to do in your life. The devil will try to lure you from your set place. When the devil wants to lure you into a place he wants you to be in, he will appeal to your selfish place: I, Me, and My. \r\n\r\nIn the set place, there is supernatural power. When you are in your set place, God will always provide for you when you are in your set place, even if it is supernaturally. \r\n\r\nThe set place is not going to always look like some place you want to go.  \r\n\r\nIsaiah 14:12-15 - There is a time for you to humble yourself. The enemy will get your timing off. You get frustrated because it is not turning out the way you want it to turn out. The original sin came from the devil and his desire to be all about I, me, and my. That is why he knows how to get you out of your set place so well. \r\n\r\nThere are certain aspects of God\'s glory, you will not see, because you are out of your set place. You need to trust the Lord to place you where you need to be. You don\'t need to argue with the Lord about where you are, because He sees things you don\'t see. \r\n\r\nYou seek the glory, not for yourself, but for others. \r\n\r\nExodus 33: 17-23 When glory is on you, people may not know your name, but they will know you have glory on you. You know when a person has been spending time with God. You have to protect the place where you receive glory. It has to be more important to you than anything. \r\n\r\nGenesis 19:12-22 You are lingering in a place that God has told you He doesn\'t want you to be. There is some things God wants to do in your life, but He can\'t because you aren\'t where you need to be. '),
('8808', 'Good evening, Pastor & Dr. Deborah Jackson:\r\n\r\nJust wanted to give you a brief update on things\r\n\r\n1. Thank you for making the final announcement about a \"special needs\" life group a month or so ago. Wasn\'t sure of the development but we will stay tuned.\r\n\r\n2. Thanks for your prayers about me getting a full time job. I got a full time job working as an AV tech at the Hyatt Regency Orlando (formally Peabody). While I was waiting to begin this job, I took a part time job as a janitor and support staff at my wife\'s school a couple of weeks ago. I got into a physical altercation with a young man at the school because he was being disrespectful to my wife and he was getting other young people to laugh at me because I was cleaning up bathrooms and sweeping up floors. I took the job just to provide for my family until the new position started and I took it pretty hard to have someone insulting me because of that. After the incident, my wife and I came to the church and spoke with Elder Adrian about the situation. Long story short: No charges were filed. The mother knows her child has been behaving poorly and has a bad disciplinary track record. She was just glad (for once) that her child was not being suspended or expelled.\r\n3. Though I now work in the evening, can I get a contact person for the Men\'s Fellowship to stay in touch with? I went to one of the meetings. I just don\'t want to get disconnected.\r\n4. We\'ve put some things on hold (business) until we get some things back in place. We\'re trying to prioritize this next season in our lives. \r\nThanks for your direction and prayers! Have a great week. \r\n '),
('8922', 'I believe I was called to teach, and with some instructions , very well.  So I\'d like to attend the classes that\'s  being given.  I taught Sunday school, back in the day and children\'s  church, at New Destiny. Even though I\'m up in age I can still do Gods work. We never get too old to learn.  \r\n                                          Respectfully  Yours in  Christ.  \r\n                                                                  Ms. Annie Vismale Rhynes.\r\n'),
('8974', 'I was diagnosis last year with Pancreas cancer (stomach pains). I\'ve gonna through chemo and I\'m schedule to have a Petscan on the 12/22/2014. God sent me to the number one church in Florida with a prayer team that can\'t be beat. Please pray for me and my family. My wife abandoned me and my 1 year old daughter and my 80 year young mother (bless her heart) is so much help to me (God sent).     '),
('8998', 'I would like to have my daughter Baptism along with myself. My daughter is one year old. I myself am a cancer patient with a power port. please let me know what we need to do, to make this happen. Thank you.');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('9048', 'I would to get more information regarding the leadership training program that Pastor will be starting in January; registration requirements, date and time for the sessions. Thank you.\r\n\r\nCornita A. Riley'),
('9268', 'On Sunday, December 28, 2014, 11:00 a.m. Service, Pastor Jackie Jackson verbalized need for help in praying in behalf of church family members facing varied life challenges, i.e. sickness, hospitalization, transition of loved ones. I am looking forward to 4th week in January, 2015 to become a member and will follow proper protocol.\r\n\r\nRespectfully submitted,\r\n\r\nLa Verne Graves'),
('9303', 'Would you please pray for my son, Ben, to excel in his next law school term, agree with me for him to receive grants, favor, scholarships and unexpected blessings this term it is difficult but I know he can do it(-he also needs to eat right and exercise .)?Just want him to really do well , get great grades and land a good job )please let me know you received this request too .Many thanks,i watch you on the Super Channel\r\n'),
('9530', 'I am requesting the 2014 giving statements under the following names:\r\n\r\nLee and Cornita Riley\r\nLee A. Riley\r\nCornita A. Riley\r\nAlta B. Scott (Cornita\'s mother up to August 4th)\r\n\r\nThank you very, very, much.'),
('10014', 'I continue to attempt to register for Pastor\'s Iron Sharpen Irons classes but the form will not accept my Address which not allow me to complete my registration.   Please let me know when the problem is resolved  deadline to register is Sunday.   thank you'),
('10497', 'Hello, I joined (signed up and gave my information) back in October but due to work schedule and the holidays, was unable to sign up for a new member class. Will there be a New Member Class on Saturday, January 24th? If so, how and where on the web site or at the church would I sign up? Thank you \r\nHarold\r\n'),
('10670', 'Please note my attempts to locate the appropriate documents and/or W2-40 online has gone unrewarded could you please either email or provide the link so I may submit information along with other documents to my accountant.\r\n\r\nThank you and God bless\r\nTrudy'),
('11047', 'Three things going on in Romans Chapter 12:1: Call to Surrender, Sacrifice, and Serve\r\n\r\nTopic: The Call\r\nScripture: Romans 12:1\r\n\r\nNotes: Christianity is a struggle because we are born again in our Spirit, but we still live in our flesh (Romans 7:18-23) Talk about our struggle with spirit and flesh.\r\n\r\nFlesh has the desire to go back where it came from....back to the fallen place from whence it came. \r\n\r\nYour flesh will tell you to do some crazy things, no matter how saved you are. The safest place to live safe and holy is in church. \r\n\r\nWe need to surrender every area of our life to God. Jesus also had to deal with the struggle of surrender. The struggle is real...\r\n\r\nThe cross kills the flesh. Most of us don\'t want our flesh to die yet, so we stay away from the cross. '),
('11121', 'Take notes here, then email them to yourself by clicking below.\r\nDate:January 11, 2015\r\nSpeaker:Marvin Jackson\r\nPlace:ROLCC Online\r\nTitle:The Call\r\nBook:Rom.12:1, Gal.5:36, Jams 4:17, Mk 14:35\r\n\r\nNotes:\r\n-Reading the book of Romans give you a reason to \r\nalways praise.\r\n                      The Three Calls\r\n1.Surrender\r\n2.Sacrifice\r\n3.Service\r\n                            SURRENDER\r\n-The Christian life is about surrendering\r\n-You haven\'t seen God\'s power manifest in your like due\r\nto lack of surrender. \r\n\r\n-Whatever you don\'t surrender, the devil will attack it.\r\n-Surrender is an ongoing process when you submit to \r\nJesus Christ. \r\n                                SACRIFICE\r\n-You can\'t sacrifice what you haven\'t surrender. \r\n-Being married is a sacrifice, these are the sacrifices\r\n1.Economic\r\n2.Emotional\r\n3.Ego\r\n-Kingdom sacrifice will always be rewarded. \r\n-People don\'t have any problems when you\'re sacrifice\r\nbut it\'s when you\'re being rewarded. \r\n-Don\'t judge a person\'s glory until you know their\r\nstory. \r\n\r\n4.Effort\r\n'),
('11479', 'Take notes here, then email them to yourself by clicking below.heb 11;3 God is like a gps,you can\'t drive a parked car,inorder for your faith to work you have to be able to hear God.Gen:22:1, when God speaks,faith goes with the word,faith goes with obey,matthew14:22-28,luke5:1-5, God asks us to give up something we love,God wants to destroy the idols in our life,money is God\'s greatest competitor,grace is a request God never denies, we have to humble our selves,');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('11744', 'Hello, I just wanted you all to know that I haven\'t been in church for about a month due to illness and financial reasons. I will be back soon and I am so glad to be able to watch online it has truly been a blessing.  Thank you'),
('12039', 'Hello Celia\r\nThis is just a note to request our 2014 giving statement? I looked for a specific link on the site, but I apologize...I didn\'t find it\r\nThank you, we will look for your email.\r\nMarvin and Rene Love'),
('12262', 'God doesn\'t wan t your prayer to be a frustrating experience Mark 11:23-24\r\n\r\nthere are some necessary devils in your life. they are there to teach you a lesson and make you better. Just as Judas was necessary in Jesus\' life, but because Jesus prayed he new Judas was necessary. \r\n\r\nthere are certain decisions you shouldn\'t make until you pray. Jesus had to pray before he choose his 12 disciples Luke 6:12-19\r\n\r\nwhatever you surrender to god he will fill it\r\n\r\nthree voices:\r\nflesh- feelings\r\nsoul-thought \r\nspirit- conscience\r\n\r\nDon\'t build a tent when he told you to build a house. some places and situations in your life are meant to be temporary\r\n\r\nand vice versa don\'t build a tent where you should have built a house,\r\n\r\nto know the difference you have to pray.'),
('12309', 'Message for today at the River of Life notes 01/25/15\r\n\r\nRose: \r\n\r\nGod will change an ordinary life. There\'s always on problems before an advancement. This year they will see miraculous blessing on you!!! There is something ready for you!\r\n\r\nJames 5:16-18\r\nLuke 11:1\r\n\r\nHow to be an affective prayer. Don\'t forget about what you pray about. The bible tells how to pray in Romans 8:26\r\n\r\nPray for our enemies. Do not pray about making negative things towards people. God wants you to have confidence after your prayer.\r\n\r\n1 John 5:14-15\r\nMark 11:23-\r\n\r\nDon\'t let your situation change our conversation after you pray with confidence.\r\n\r\nPray.....pray....pray....pray.....pray......pray\r\n\r\n11 Cori nthians 4:18\r\nEverybody that is in your crowd is not in his corner. Take the time to pray!!!!\r\nMark 6:\r\n\r\nGod reveal, expose, and remove anybody that isn\'t suppose to be in my life and bring the right ones into my life, Prayer elevates your life.\r\n\r\nDave Hollister gospel singer\r\nHelp me'),
('12500', 'Rose Grace Trombly (fka Conway)\r\n\r\nPlease note this is an update for our last name.  I am legally changing my name and Rose\'s last name to \"Trombly.\"  Please give me a call if you have any questions.  I just wanted our membership updated to reflect the correct last name.  Thanks very much!'),
('12692', 'to the U.S.A. I teach to the Body of Christ (in Hosea, God says His church is destroyed for lack of knowledge) all about our current \"funny money\" system, I teach them deliverance from the evil spirits of Debt and Credit, I show them how to rely on Jehovah-jireh, I teach them how the 10% tithe is no longer enough (will a man rob God?), I teach them How we might go from Fiat Money\r\nto the Mark of the Beast. \r\nI can come visit you on Saturday (I live in Melbourne). Call me at 321-266-7219. Thank you.\r\n\r\nLawrence Sarsoun\r\nlsarsoun@yahoo.com'),
('12830', 'Good afternoon, \r\nI wanted to inquire if Pastor Jackson would be able to perform our wedding ceremony Saturday September 26, 2015. I know his schedule probably fills quickly and wanted to give enough time. Also, my fianc and I wanted to know about the pre-marital counseling you offer? Thanks in advance and I look forward to hearing from you. \r\n\r\nVenecia Jenkins'),
('12863', 'My husband had brain surgery last sunday he had 3 aneurysms one bursted causing bleeding on the brain he\'s making great improvements but we still have a long way to go we\'re new to the ministry and I\'m not sure how everything goes his name is Derrick Watts we\'re at FL south in the ICU room 11831 thanks.'),
('12914', 'Greetings, I was a participant in the January 31st New Beginnings Class. As a result of one of my questions, Eric asked me to send a message to INFO@ROLCC.COM or maybe this email address. During the class, the principles of tithes and offerings (blue envelope) were present from a standpoint of \"What we believe\", \"Why we believe it\" and \"Where it can be found (in the bible)\". I completely understand the principle and have followed them since an early age. The Love Offering (white envelope) gift was briefly talked about but there was not the same \"What we believe\", \"Why we believe it\" and \"Where it can be found (in the bible)\" information provided in the new member book or during the class. I personally believe Pastors Marvin and Deborah Jackson do an amazing job and I understand they are not given a salary but it would be helpful to have some additional context, scriptures and reasoning for this principle and practice. With Love Thank you Harold'),
('12915', 'SECRETS OF SUCCESSUL PRAYER\r\n\r\nLuke 11:1\r\nJames 5:16-18\r\nRomans 8:14-17\r\nGalatians 4:4-7\r\nIsaiah 4:10\r\nPsalm 119:67, 71-72\r\n\r\n\r\nDont let the devil make you feel you are not worthy of the prayer.\r\n\r\nTHE STRENGTH OF YOUR RELATIONSHIP\r\n\r\nPray from the strength of relationship\r\nSay \"Our Father\"\r\nWait on him he is going to show up! Lean with it one time!\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('12983', 'Take notes here, then email them to yourself by clicking below.\r\n\r\nWe need to have confidence in prayer.  We need to pray in His Will.  Don\'t wait to praise Him until you get the blessing, praise Him now.\r\n\r\nDont pray to Jesus, but Jesus said pray to the Father and ask for it in Jesus\' name.  Because just like a check to be cashed, if the name is no good it wont get cashed, but because Jesus\' name is on it and He has written it to me, the Father will provide.\r\n\r\nWe are not righteous because we get it right all the time, but it\'s because we are in Christ Jesus in the Father who made us righteous'),
('13038', 'Hi,\r\n\r\nI\'m asking for prayers for my family.  My sisters and I are going through a tough trial.  Our father passed away yesterday.  Today, my sister, Xiomara Hickey, was admitted to the hospital.  We are praying, but we would definitely appreciate some agreement.  Thank you so much.\r\n\r\nSincerely, \r\nMelodie Hickey'),
('13039', 'the Secrets of Successful Prayer (The Kingdom)\r\nluke 11:1-2 \r\njames 5:16-18 sometimes the key to unlocking your healing is praying for someone else\r\n\r\nafter prayer you should give God praise as though it\'s already been done in the natural.\r\n\r\npray from the position of relationship - your heavenly father \r\nthe character of God is revealed in his name. he says I am who I am. he\'s whatever you need in that particular moment. He can be your healer, lawyer, teacher, whatever you need\r\n\r\nPhilippians 4:6 partition prayer\r\nMatthew 6- again he mentions himself in relationship your 1st pursuit should be a personal pursuit with the kingdom of God\r\n\r\nThe kingdom- \r\n\r\nGenesis 1:26-28 we were created with dominion in mind \r\nwithin the kingdom there is no lack but the kingdom is within you which means it\'s possible for your life to have no lack\r\n\r\nwhen you make yourself a priority you will not be someone else\'s option\r\n\r\nPsalms 115:16 \r\n\r\nJesus can be your savior but that doesn\'t mean he\'s your Lord. We call him our Lord, but are we doing what he says to do?\r\n '),
('13132', 'St.John14:27-30 Jesus final instructions\r\n\"Keeping the peace\"\r\nDis-e(dis eaze)\r\nThe human body wasn\'t design to handle certain type of sin or disease.\r\nDaniel 3:16\r\nIf someone in your house that won\'t let you have peace,you have to put them out'),
('13145', 'Good afternoon, \r\n\r\nMy name is Rebekah Taylor.  I am unsure of who is going to read this message but I just want to say how the message this morning in 9:00 service was truly a blessing to me.  A little background about me, I have been going to this church off and on since I moved to Orlando for law school in 2008. Being the child of a pastor and knowing how \"church folk\" can be it took me a while to become a member.  I joined this church the summer of last year.  My mom has been telling me this is where I\'m supposed to be and I knew that was the case, but if God wanted to confirm it any further he did so in the 9am service on 2/22/15.  My heart was broken by an individual I thought was the love of my life November 2014.  He said God told him we weren\'t meant to be together, that we were a good idea in theory but nothing more past that.  I was so hurt, but kept coming to church because I prayed to be close to God just like when I was a child, when I asked no questions and just did what he said.  The night he broke up with me over the phone I was led to seek God first.  God told me I needed to pray for him because he has not felt God\'s love so he couldn\'t love me.  That was difficult for me because he just kicked me to the curb, but I did it.  This past Thursday his brother called me to tell me he got a new girlfriend.  Want to talk about setback!! I felt my heart had torn to pieces all over again because although I knew his reason for breaking up with me was an excuse I really wanted to believe that it is what God told him even though I never got that confirmation.  Now I do not say at all that I was completely right in this situation, we fed our flesh before we were completely in line with God\'s word.  Our relationship was tainted from the beginning.  We decided to stop doing all those things and really adhere to God\'s word, I thought we were getting closer but he broke up with me and I was completely distraught.  I didn\'t know what to do but I kept reading my word and kept having faith.  I took responsibility for my part in all this which was entertaining my flesh. Now I\'m praying for him asking God to show him his love and he found something else in another woman not even 2 months after breaking up with me.  I really felt like giving up.  People always tell me men and women alike that I am the model individual, I do not follow the crowd, if it\'s not right I don\'t do it.  They say I am everything a guy could want in a woman and this happens to me, I didn\'t know what to do, thought it had to be me.  My mom was there to kind of whip me back into shape but I was still trying to understand why God would tell me to pray for him when he chose to go in the same direction he went in the past.  I read one of my devotions probably the same day I got the news and was led to 1 Samuel where Saul didn\'t obey the word of the Lord.  Through Samuel God said he would send a man after his own heart.  Fast forward through my tears and wanting to quit and here comes Sunday morning.  How to recover from a setback, and what is referenced?  Saul and David,   I honestly do believe just as Pastor Deborah says She is his favorite daughter,  I was God\'s favorite today because that message was for me.  I was beating myself up for loving him, praying for him everything and God spoke through Pastor Jackson directly to me in what I needed to do.  I could go on and on and I am still in the midst of my hurt but I will continue to seek God and obey his word and I will tell you exactly what my victory looks like.  I am so happy that God saw it fit for me to be a part of this body.'),
('13201', 'The rest of my life will be the best of my life. \r\n\r\nDon\'t insult God by being something that your not. \r\n\r\nEphesians 3:20 - God has a plan and purpose for your life and to wants you to have super abundantly things in your life. \r\n\r\nWe are blessed to be a blessing. when you have it\'s a blessing to be able to give\r\n\r\nAnything that you would ask DARE or think believe. If your going to think you may as well think big, through God all things are possible.\r\n\r\n                                                                    D.A.R.E\r\nDecide- how you will start your day. Make the most out of your day. Proverbs 4 decide to get            wisdom\r\nAccept responsibility- changing things that you need to change\r\nRespond generously- If you want to expand the level of your getting expand the level of your   giving.\r\nExpect favor-  God will take care of you'),
('13203', 'Let the rest of my year be the best of my year..John 16:33; we can go through some things, but be of good cheer - lighten up, enjoy life. We need to learn how to enjoy life in the midst of our trials and tribulations.Its a choice to rejoice\r\nDARE\r\nD=decide; today will be a good day; decide to get wisdom - be a learn it all\r\nA=accept responsibility; quick blaming others for your problems; what do I need to do/change in my life. If we do our best, God will do the impossible (Person of Jesus prepares your heaven; Principle of Jesus prepares us for earth)\r\nR=respond generously;\r\nE=expect favor;whatever you recognize become thankful for\r\n'),
('13240', 'What to do when you don\'t know what to do.....\r\n\r\n-2 Chronicles 20:1-13, 14-17\r\n-- Josephat prayed to the Lord our God when Ammon, Moab, and Mount Seir came against Judah \r\n\r\nShowing up is more than half the battle. Come to the church when trouble begins.'),
('13268', 'I need your help,  to support my first children\'s book getting published.   I opened a donation website at   https://fundly.com/children-s-book-publishing-1    I need your help, donation and support. Please!\r\n\r\nMy campaign: \"Children\'s Book Publishing\" is underway and in order to reach my goal I need your contribution. \r\nHow your donation will help: I wrote my first children\'s book, and I need help to publish it and get it out there for many children and young adult who loves fantasy and sci-fi to enjoy. The book is called (The Diamond Sword)\r\nMaking a donation is super easy! Simply visit my campaign page and click donate. Any amount makes a difference!'),
('13274', 'This message is for Eric Youman, we discussed about a month ago some suggested edits and typos I identified in the New Beginnings manual. I would be happy to share them at your convenience. Thank you Harold');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('13299', 'Good Afternoon,\r\n\r\nMy husband and I recently became members at ROLCC and are excite to begin actively participating in church functions. I am currently completing my masters level education in social work and will graduate in August. I am seeking to begin my career in counseling, specifically Christian counseling. God has revealed to me that my service will be in the church. I have heard Pastor Jackson mention counseling in sermons, but I am unable to find information of this service on the website. \r\nI would greatly appreciate any information you can provide me on how I may begin to use my strengths and education in service to the ROLCC ministry. I pray this message reaches the pastors in order to inquire into any revelation given to them from God on my service or employment.\r\nPlease see my attached resume and feel free to contact me at your convenience.  \r\n\r\nThank you,\r\n\r\nBrittney Hughley-Thompson\r\nbrittneyhughley@yahoo.com\r\n(407)235-2083'),
('13306', 'Orange County Public Schools (OCPS) Parent Academy is a district-wide initiative designed to enhance student achievement through the support of community and family involvement. Through the Parent Academy classes, we provide FREE parental development skill-building workshops, specialized parental support, educational events, and activities for families throughout the school year. Orange County Public Schools is hosting a Parent Academy event on Saturday, April 4, 2015 at Windy Ridge K  8 School. \r\n\r\nWould you please share this information with your congregation? \r\n\r\nCome join your OCPS Parent Academy as we present, Great Beginnings: Transitioning to New Heights, on Saturday, April 4, 2015, at Windy Ridge K-8 School, located at 3900 Beech Tree Drive, Orlando, FL 32835 from 8:30 a.m. to 12:40 p.m. \r\n\r\nHave you been thinking about what you need to know when your child enters Pre-K or Kindergarten? Are you concerned about what will happen as your child enters, middle, high school or college? Then the next Parent Academy was designed with you in mind. \r\n\r\nThere will be activities to engage everyone. Lunch is included, and interactive childcare is provided for children ages 412, so bring the whole family. Parents will receive free resources and each child will take a free book home. \r\n\r\nYou may register online at www.parentacademy.ocps.net or call 407.317.3300 to register by phone.  On-site registration will also be available on Saturday, April 4th at Windy Ridge K-8 School. We hope to see you there!\r\n\r\nShould you need additional information, please feel free to contact me.\r\n               \r\nKatrina Summerville\r\nOrange County Public Schools\r\nTitle I Services\r\nPhone: 407-317-3200 x2002736\r\nkatrina.summerville@ocps.net\r\n\r\n'),
('13376', 'Good day,\r\n\r\nI am actively seeking an Executive Administrative Assistant opportunity in a demanding, fast-paced, multi-tasking and team playing working environment.  My ten plus years of executive and personal administrative assistant experience has equipped me with a multitude of skills which can be utilized to maximize client service and increase company profitability.\r\n\r\nThroughout my career I have demonstrated for my employers an exceptional facility for meeting organizational objectives and demands.  In addition to my administrative/secretarial skills, I am detail-oriented, energetic, quick-learner, team-player and stay abreast my work assignments.  I am certain I would prove to be an asset at your establishment as well.\r\n\r\nAfter reviewing my resume should you agree that my work experience and talents meet the needs of your establishment, I would greatly appreciate the opportunity of speaking with you at a time we both agree on.  Thank you in advance for your consideration.\r\n'),
('13383', 'I am a member of the church. My entire family attends the River of Life. I am saved of course. I am a recent graduate of UCF with a bachelor\'s degree in Health Administration. I have several years of experience in healthcare and customer service. I work well with people and I actually love working with people. I am hard working and very dependable. I am excited about this position. I am been looking for months since graduation and I would much rather be in my church than a office some where else. I look forward to hearing back from you. Thanks for your time. '),
('13396', 'Im a apart of the praise and worship and have been blessed to work in administrative support positions for the past 18 years. I have experience in both Non profit and government sector.  In addition I have advanced skills in Quickbooks,  Excel, and Word. I would like to have an opportunity to meet with someone in order to discuss my background further. \r\n\r\nThank you, \r\nShelley Holston'),
('13398', '3/22/15  LIVE STREAM:   \"A FIGHT TO THE FINISH\"\r\n\r\n2 TIMOTHY 4;1-8\r\n\r\n1) HE FOUGHT \r\n2) HE FINISHED\r\n3) HE KEPT THE FAITH\r\n\r\n FINISH WELL IT DOSENT MATTER HOW YOU START, BUT HOW YOU FINISH\r\n\"BETTER IS THE END OF A THING THEN THE BEGINNING \"\r\n -IF YOU DONT SEE A MAN YOU WONT KNOW HOW TOBE A MAN.\r\n-MANY TIME THE REASON WHY PEOPLE QUITE ONTHIS JOURNEY BECAUSE THEY DONT SEE THE TROUBLE/ THINK THAT CHRISTIAN ARE TOHAVE TROUBLE.\r\n- \"JUST BECAUSE YOU FELL DONT MAKE YOU A FAILURE\"\r\n\r\n-THE KEY TO MANITFESTATION IS CONTINUOUS\r\n- GOD WILL ENCOURAGE YOU IN A ROUGH PLACE BEACUSE HE WANT YOU TO FINISH\r\n\r\nEPHESIANS 6;10 THE FIGHT THAT YOUR IN ISN\'T A NATURAL FIGHT IT\'S SPIRITUAL.\r\n- DONT PRETEND TO BE WHAT YOU DON\'T INTEND TO BE\r\n-ALL KINDS OF WAY THE DEVIL WILL COME TO YOU \r\nEX; CAREER, FAMILY ,FRIENDS, \r\n\r\nHEBREW 4;2 \'\'DEVIL JOB IS TO GET YOU ALONE\'\'\r\nHEARING THE WORD OF GOD IN CHURCH IS NOT GOING TO DO NOTHING IF YOU DONT USE IT OUTSIDE OF CHURCH.\r\n-STAYING IN THE WORD OF GOD NOT JUST IN CHURCH, BUT ALL THE TIME \r\nIT\'S BETTER TO TAKE THE LONG WAY THEN THE WRONG WAY.\r\n-INTEGRITY MAY NOT PAY OFF IMMEDIATELY BUT IN THE LONG RUN IT WILL PAY OFF INTHE END.\r\n\r\n2CORINTHIANS 10;3-5  \"THE BATTLE IS IN YOUR MIND\"\r\n\r\n\"ENERGY FLOWS WHERE ATTENTION GOES\"\r\n-HOW TO GIVE THOUGHTS TO NEGATIVE SAYING?  IS WHEN YOU START SAYING THAT VERY NEGATIVE THING.\r\nONCE YOU START ARTICULATING YOU EMPOWER THE THOUGHTS.\r\n- PUT IMAGINATIONS AND THOUGHT S WHERE THEY ARE SUPPOSE TO BE \r\n-NEVER ACKNOWLEDGE A HATER CAUSE THE MOMENT YOU DO YOU HAVE NOW GIVING THEM POWER.\r\n- SO REFUSE TO ALLOW NEGATIVE THOUGHT TAKE A RESTING PLACE IN YOUR MIND.'),
('13405', 'Hello Pastors Marvin and Deborah Jackson,\r\n\r\nMy name is Arlene Williams. It was a honor to present today, 03/22/2015, for worship. It is such a blessing to sit in the audience and listen to the message that God gives you to give to his people.  \r\n\r\nPlease find my attached resume for your review.  I am hoping that consideration would be favorable on my behalf as you review my resume. \r\n\r\nBriefly, I am a very motivated, determined, respectful, and a very teachable person. It would be such a humbling position for me to serve as an administrator, in the business aspect at The River of Life Christian Center.\r\n\r\nThank you for taking the time to read the information outlined in my resume.\r\n\r\nRespectfully,\r\nArlene Williams'),
('13412', 'Dear Human Resources Manager,\r\n\r\nIn view of my progressive experience in organizational administration, I am writing to express my interest in the advertised Executive Administrative Assistant position.  Since my initial experience in the non-profit sector over fifteen years ago as a Youth Care Worker, I have continued to fulfill my commitment to affect capacity building efforts in my community, and I am confident that I can be a great asset to this ministry as God continues to order my steps.  \r\n\r\nMy attached resume highlights my range of experience and skills in the areas of enterprise development and administration.  A purposed, innovative and enthusiastic servant-leader, I believe that I can greatly contribute to the Kingdom objectives of the River of Life Christian Center of Orlando in the capacity of Executive Administrative Assistant.\r\n\r\nThank you for considering my candidacy.  I am excited about the possibility of offering my knowledge, skills and abilities to the enduring work at The River.  I would appreciate the opportunity to further discuss my qualifications and can be reached by phone at (321) 275-0176 or (407) 290-5694, and by email at denicemyers@hotmail.com.  \r\n\r\nSincerely,\r\n\r\nDenice D. Myers\r\nROLCC Member'),
('13429', 'A Customer Service/Security Officer Specialist with an excellent ability to work on a wide variety of tasks while maintaining excellent attention to detail.  Motivated self-starter, eager to learn with the ability to work independently as well as part of a team. Possess great leadership and communication skills.'),
('13460', 'Hello,\r\nHope you are doing well,\r\nI would like to take this opportunity to introduce our Ad Network. My name is Nihanth. S, Publisher Manager for Yellow Ad Network.\r\nYellow Ad Network is one the biggest and fastest growing Ad Network in the industry. Yellow Ad Network provides a complete solution for publishers to generate huge revenue from their websites by offering them the best possible rates in the industry.\r\nI have been working closely with website owners like you and helping them to monetize their inventory. Yellow Ad Network is a global CPM Ad Network that currently serves over a billion impressions per month globally and caters to over a 100 advertisers across various verticals. We work with top advertisers and handpicked publishers to produce the best results for our partners. \r\nWe also monetize your unsold inventory to bid high rate and provide better eCPM rates. \r\nAdvantages In Working With Us:\r\n      Highest possible rates in the industry.\r\n      Dedicated industrys best experts to monetize your Traffic.\r\n      Wide range of campaigns (CPM, CPC, CPA, CPL)\r\n      100% guarantee industry-leading inventory filling rates.\r\n      100% guaranteed on time payments.\r\n      Different Payment Models. (Weekly, Monthly & Net-60) \r\nWe always believe in only one word, i.e. We Are Only Successful When Our Affiliates Are Successful.   \r\nInterested in working with us, its very easy to join our network. Just send us your website and traffic details, our experts review it and help you in creating an account. \r\nIf you have any questions please dont hesitate to ask us we are always here to help you.\r\nRegards,\r\nNihanth. S\r\nPublisher Manager\r\nYellow Ad Network\r\nnihanth.s@yellowadnetwork.com\r\nPhone:	832 539 3535\r\nSkype:	nihanth.yellowadnetwork\r\n');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('13473', 'I have been in transition for three years now.  I am currently still an active tithing member of Deep Creek Worship Center in Punta Gorda with Pastor Walter Branch (863-990-0963) because of the homeless initiative God has burdened my heart to complete for the people of Desoto County community (please read bio).  It is my hope that the housing projects are complete in year 2015 by the affiliation of a regional initiative (Heartland Community Housing Organization\'s Initiatives) for which I am co-chairperson.  It is also my hope that God will raise up non-bias, non-prejudice leaders by which I can pass the torch after the housing projects are complete.'),
('13494', 'Hello and I am excited to be submitting my resume\' for the position of Executive Administrative Assistant for the River of Life Church. I have extensive experience in administrative duties; which also includes church administration. At my prior church I was involved in the very conception of it from their living room to the actual church opening. I understand the utmost importance of confidentiality of the Pastors\'; as well as each and every member, and feel I would be a great asset to the River of Life ministry with this background. I am truly saved, sanctified and Holy Ghost filled and love the Lord, my brothers, sisters and even the haters with ALL my heart. Hope to hear from you with interest in meeting me for an interview. God Bless! Tahara'),
('13501', 'I am a new member to ROL and recently laid off from my job.  I have 16 years experience in customer service and about 10 years experience in various administrative positions and it started even earlier than that (my father is a retired pastor of over 40 years so he utilized all his children at one point or another in his office).  \r\nI am attaching my resume, I appreciate the consideration for the position.'),
('13508', 'To whom it may concern;\r\n\r\nI am a firm believer in quality and excellence. With my strong impeccable work ethic, leadership and customer service background i am well fit for this job. I will deliver nothing less than the best and execute all administrative duties as needed and beyond. I do ask that you take time to review my resume as it serves it\'s purpose of a snapshot of my skills and prior work history.\r\n\r\nWarm Regards, \r\n\r\nJazzmine Tramel \r\n321-460-6451 '),
('13551', 'To whom it may concern,\r\n\r\nWhile going through your job requirements for the position of Executive Administrative Assistant, I felt as if it was an exact print of my qualification.  Having achieved a solid foundation of knowledge in my career of Administration, I would like to express my interest in consideration for the position of the Executive Administrative Assistant.\r\n\r\nI am extremely computer literate in Microsoft Office including Word, Excel, Publisher, and Power Point. Excellent attention to detail and great organization skills \r\n\r\nMy comfortable demeanor gives me the ability to command taxing situations while encouraging a sensible, composed atmosphere. Most importantly, I quickly learn your preferences, your goals and objectives, and Ill do my very best to aid in the leadership of the church.  I am confident that my detail oriented work habits will aid in the efficiency of Rivers, while my positive attitude will make me a seamless addition to your team.\r\n\r\nThank you for your time and consideration.  I look forward to speaking with you soon.\r\n\r\nTheolinda Valentine\r\n'),
('13582', 'Dear Pastor\r\nI reviewed your requirements for the position, I\'ve been hesitant about submitting my resume because I don\'t type 55 plus words per minute. I took two typing test in Nov 2014 for the county & city they were 40 & 42 words per minute. I do understand if that will not work for the position. However I thought that at the very least I should try, after all God knows what he wants for me. Also school is coming to a close June 3rd I will be unemployed during the summer anyways. I\'m currently only a substitute teacher. I really wouldn\'t mind even volunteering to help out in the office if needed even if you select another candidate for the position.'),
('13623', 'Good News From the Graveyard!\r\nThe empty tomb validated the man and his method.\r\nLuke 24:36\r\nMy sin debt has been satisfied.\r\nJohn 18:28-30- it is finished text\r\nGalatians 2:13\r\nThe curse of sin has no more power in my life.\r\nGalatians 3:10, Deuteronomy 21:22-23\r\nWe have received the adoption of sons\r\nGalatians 4:4\r\nI have a future that goes beyond this lifetime. \r\n'),
('13644', 'Pastor,\r\n\r\nGood Afternoon! I am a member of your church and usually attend with my friend Damonic. This past Sunday I brought a friend of mine to church. She like myself has had some experiences in church that has deterred us from finding the right church home. \r\n\r\nAt church this Sunday, we were so moved and grateful that you followed the Holy Spirit when instructing you to speak to the women and men. Also, we appreciated when you sternly but respectably told the congregation about being respectful when leaving the church. She also appreciated the fact that you read from the King James bible and that you were teaching Gods word! (There\'s a reason why) I felt the same way, too. Truly blessed! These things may seem minute to some but its huge for us. Especially my friend this Sunday with her back story and her diligent desire to learn Gods word. Many pastors don\'t preach the word and are afraid to allow the Holy Spirit to convict us with the truth because without it, we perish for lack of knowledge and we\'re all so grateful you do! My friend even reads the Strong\'s concordance when reading the word of God to just grow deeper in understanding. I\'m not there yet, but one day I will as I\'ve been hearing the call for me to grow deeper in him as well. My point for saying that is that its evidence that you are truly anointed and you aren\'t afraid to preach the word. \r\n\r\nWe both have discerning spirits and its good to walk into church and not feel that its a lot of mess going on within the church. Not that the spirit of the Lord isn\'t present when his people come together in other churches but its such a distraction to my spirit when I\'m in a church and can feel that the Pastor and members are wrapped up in a lot of mess and terrible things. We all aren\'t perfect but I\'m just saying. :-) My friend also has tried many churches and have been deterred for many reasons such as not having alter calls, or the Pastors just follow an online teaching without allowing the holy spirit to flow. She enjoyed praise and worship and Every thing mentioned above!! \r\n\r\nI love you and your wife\'s relationship and how you both just persevere and work together, standing in the middle of a battle field every week to help, teach, feed. motivate and inspire us all! Thank you for the work you and your wife do for Gods kingdom. Nowadays, its refreshing and so needed! Well, have a blessed day and thank you for taking the time to read my message in advance. Sorry if it doesn\'t make sense. Trying to convey my heart and get back to some other things. God bless you!'),
('13650', 'I\'m presently in the hospital and I\'m requesting prayer for me and my family. My husband has been off from work for three weeks due to back injury. Now it\'s very difficult on my family now. We need prayer. I feel isolated from family because no one can step up to help my family.\r\n\r\nPlease pray for us.\r\n\r\nI need the Men\'s ministry to help my husband. He needs to consult with Godly men. I don\'t want him to loose faith and loose focus.\r\nI\'m at Florida hospitL Altamonte Springs\r\n\r\nPlease help\r\n,'),
('13656', 'I just moved here from out of state couple of weeks ago looking for work i don\'t know anyone\r\nhere or my way around. I saw pastor Jackson on tv and i decided to come check him out and i was blown away with the service pastor kept it 100 and down to earth.so i joined the church\r\nthat day. This is the place were will make my new start');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('13663', 'I been going to church sometime and i watch the program tv plus watch in internet...\r\nI go to other church sometimes but for i been going true as of my life your services have been a really helpfull.  Not sure if you do counseling for not members but i would like to know if you can\r\nthank you\r\nGod bless\r\n \r\nLourdes Soto'),
('13706', 'Please include my family in prayers for continued favor in our wk place my son for strength to complete med school and our grandchildren to stay on the path of Gods love I also ask a special prayer for my health issues Ty Gladys '),
('13770', 'Please share with your congregation our Relay for Life event May 16, 2015 from 2pm until 12am at Robert Hungerford High school track in Eatonville (corner of Kennedy Blvd and Wymore). Our opening ceremony will begin at 2pm and the cancer survivors lap will follow right after. We will also have a survivor dinner on site beginning at 6pm. A family friendly event as we celebrate survivors and remember those that fought a good fight. Thank you for your time and consideration.'),
('13797', 'Good evening,\r\n\r\nI am hoping to get a message to the pastor for guidance. However, if there is another that can answer my question, that is acceptable as well. \r\nGod has revealed to me that I will be doing Christian Counseling. In  August I will have completed my masters degree in social work, qualifying me to be a counselor. However, I am hoping to learn what additional steps I must take to become a Christian counselor, such as theology school certification(s). Is there any information that can be offered as to the requirements of the field?\r\n\r\nRegards,\r\nBrittney Thompson\r\nbrittneyhughley@yahoo.com\r\n(407)235-2083'),
('13815', 'I submitted this to ahunt@rolcc.tv. after a memorable visit to your Church on 4/20:\r\n\r\nPastor Jackson:\r\n\r\nI felt compelled to draft a letter to you after Sundays 11am service.  My name is Tara Gilbert, I have attended a Lutheran Church my entire life and since moving to Florida, my manager invited me to service at your church.  I was completely in awe of your message and the eloquent way you incorporated teaching into a sermon with a message that was not only inspirational but so genuinely moving; I have not stopped re-playing the recording.  \r\n\r\nI am writing on behalf of my boyfriend that I made accompany me to Church service.  We have all had difficult lives, faced many challenges, and elected to make mistakes; however, life has dealt him a rather arduous hand.  At the end of the service, you called for three-types of people to come to the alter, while we were all holding hands during your prayer.  My boyfriend squeezed my hand during several poignant points in your prayer; surprised, he said he wanted to go to the alter  I went with him.  It was there I could see his eagerness and willingness to make a change, this was a huge moment.  At the end of your prayer you gave directions on where to go for further assistance but it was this point that you told him, wait, I need to speak with you.  You asked his name, Damon, and you powerfully spoke directly into his Spirit.  He looked into your eyes, shook your hand, and received it.  As I waited in the foyer, I saw my manager (who also knows him) and we both sobbed,  - sobbed at the turn-of-events for Damon.  I know his potential; I speak into it, pray into his life.  Pastor Jackson, Damon knows his word.  As you were reading from Genesis, Damon would finish the verse before it was presented on the screen and I would turn to him in amazement.\r\n\r\nI am sure people judge him, his tattoos, his strong demeanor but the Damon I know is a good person with good intentions but oftentimes, rides the fence in doing what is right and good (he calls me living wholesome) versus what is offered in his community.  He was in awe, awe of your message -  and that of all the people ..You spoke to him. The greatest, most-wonderful thing that has happened to him in a long time.\r\n\r\nI am far from perfect.  I was just raised differently from Damon; I am not oblivious to his plight, it just was not always part of my reality  this is a bone of contention in our relationship, but one I am not going to relinquish in defeat.  I am writing because I want to know what I can do?  How do I support a new walk with the Lord?  He has obstacles but I am willing to help as best possible and I know he thoroughly enjoyed your message (even before the alter-call) because he kept saying, he is really a teacher!  What should his next step be?  What is my role? I know this probably seems a bit fundamental but I have never accompanied anyone to the alter and I just do not want Damon to lose his momentum.\r\n\r\nThank you for taking the time to read my message and I appreciate any feedback, if and when time permits for you, with a hectic schedule Im sure.\r\n\r\nThank you Pastor Jackson. I am in awe myself your\r\n entire ministry. Just amazing. \r\nContinued success,\r\n\r\nTara Gilbert\r\n\r\n305-407-5715\r\n'),
('13816', 'Luke 5:1-10 NIV\r\n1 John :5:14 KJV\r\nJob 36:11 KJV\r\nIS 1:19\r\n1.Willing santification..I going to live \r\n   2 Tim 2:19-21 KJV\r\n2. Word saturation\r\n   Ps 1: 1-3 KJV\r\n   Joshua 1:8 KJV\r\n3. I must actively worship the savior\r\n4. You must have a desire to win souls.\r\n    Ps 67:5\r\n5. I must exercise wisdom in my soul. I must sew:  systematically(giving), spontaneous giving strategic usually a pattern. give in , sacrificial, \r\n6. Work 1-5\r\n7. Wait  '),
('13860', 'Hello, my name is Jessica. I know this is a long shot because I am not a member of your church but I am seeking help. A few months ago myself and my family (husband and 6 children) lost everything. We had to live in an extended stay hotel. Well now my husband lost his job about a month ago and just started working for a new company. However we have financially fallen short on paying for our room and are facing being on the streets with our babies. He will not get paid until the 11th of June. Our room is due this Saturday, May 30, 2015 by 11AM. I have called 211 and reached out to many agencies with no luck at all. Even a point in the right direction would be amazing. I am in tears as I write this. I will do anything to keep my angels safe. Thank you so very much for taking the time to read this.'),
('13861', 'Faith, Pateince and getting results\r\n\r\nHebrews 6v10-15\r\n\r\nBe diligence, don\'t be lazy (Lazy people won\'t make it to the kingdom. To get into the promise land you need faith and patience.\r\n\r\nBlessings were received after patience.\r\n\r\nResults are the pay off of the sacrifice investments of your time.\r\nResults take time!!!\r\n\r\nwe now live in a microwave society where peeps want things now!! i.e instant mash potatoes instant rice etc\r\n\r\nin order to see the blessings you have to go through a season of waitingin the waiting process so many things can happen and come against you....you have to learn to hold on until you see the thing God as promised you. \r\nGod is not unrighteous to forgetsometimes u go through things and think God as forgottenyour feeling God was detached from your sufferingsometimes your faith is being tried!!! during this time is when you have to buckle down and wait on God.\r\n\r\nMen will forget but God won\'t forget.\r\nGalatians 6 v9 (when you get tired of waiting read this scripture for encouragement)\r\n\r\nWhilst waiting for results praise God right nowbecause God as promised a Dew season.\r\nDiligence has its results.\r\nIn Hebrews 6v12 he says \'don\'t be lazy but followers of them\' THEMwhose them???\r\nneed to learn to follow instructionsfor results\r\n\r\nBefore God gives you a supernatural blessings he will give you an instruction and once you have followed the instruction you will see the results.\r\n\r\nJeremaih 29v12-13\r\nhow bad do you want it! God is looking at the intensity of your pursuit.\r\nGod doesn\'t want no half hearted pursuit..\r\nBe persistent.. so God knows how bad you want it.\r\n\r\nLuke 18v2-5\r\ndiligent and diligent pursuit\r\nif u seek me your will find me, if you knock the door will be open..but you have to put in some kind of effort.\r\n\r\na slothful person (lazy),,,,be not slothful but follower of those with fait and patience\r\nproverbs 14v23\r\nwhenever u put in work there will be some type of benefit from your labouryou have to put in the work\r\n\r\n1 Corithians 15v58 (pursue with purpose and intent)\r\nbe ye stead fastunmovable always abounding in the work of the Lord.\r\n\r\nThem (hebrews chapter 11--Noah and his wife and kids being diligent for 120 years.)?? find people that have experiencethat have been therefollowers of  Christ.\r\n\r\nyou will make mistakes but don\'t let the mistakes define you\r\n\r\nGod is not looking for perfect people he is looking for people that will pursuit him. When you fall get up, pray and keep on trying\r\n\r\n\r\nyou need a pattern and example you need to see the beginning and end of a persons faithas to be some level of transparency!\r\n2 timothy 3\r\n\r\n\r\n\r\n\r\n\r\n'),
('13868', 'Early this morning Antonio and his godbrother family.was awaken and the house was on.fire he has lost all material things but we\'re blessed he\'s still with us is there anything the church can do to assist Antonio we have set up a relief fund. But that\'s all at the moment.'),
('13869', 'Pastor Andre Neal\r\nJeremiah 29 the plan I have for you\r\n1. Study this book of instruction continuously.  Study so you understand.  Have to develop an appetite for the Word of God.  The enemy plot is still the same but the tactic has changed in this age.\r\n2. Meditate on it day and night so you will be sure to obey it.  In order to get the Word on the inside of you, you have to meditate on it.  Put them in a place where you can see them.\r\n3. Obey everything.\r\n\r\nIt\'s not an option to read the book it is survival for you.\r\nGod prepares us for everything we will encounter in our lives if we are connected to him.\r\n\r\nChallenge: 579 Plan\r\n1. 5 minutes of worship\r\n2. 7 minutes of word\r\n3. 9 minutes of prayer\r\nYou will watch the clock at first but after awhile, you will get into his presence.  It will be impossible to get in His presence and not be changed.\r\nIt\'s God\'s plan for us to prosper in everything we do.');
INSERT INTO `wp_rg_lead_detail_long` (`lead_detail_id`, `value`) VALUES
('13871', 'Pastor Andre Neal\r\nJeremiah 29 the plan I have for you\r\n1. Study this book of instruction continuously.  Study so you understand.  Have to develop an appetite for the Word of God.  The enemy plot is still the same but the tactic has changed in this age.\r\n2. Meditate on it day and night so you will be sure to obey it.  In order to get the Word on the inside of you, you have to meditate on it.  Put them in a place where you can see them.\r\n3. Obey everything.\r\n\r\nIt\'s not an option to read the book it is survival for you.\r\nGod prepares us for everything we will encounter in our lives if we are connected to him.\r\n\r\nChallenge: 579 Plan\r\n1. 5 minutes of worship\r\n2. 7 minutes of word\r\n3. 9 minutes of prayer\r\nYou will watch the clock at first but after awhile, you will get into his presence.  It will be impossible to get in His presence and not be changed.\r\nIt\'s God\'s plan for us to prosper in everything we do.'),
('13878', 'Good evening:\r\nMy wife and I were invited to attend a Crown Ministries meeting on Friday or Saturday by one of the elders of the church. I never grasped his full name. I know he\'s an elder and he also serves as an usher during second service when my family comes for Sunday service. He\'s a grey haired gentleman and I believe on the board of Crown Ministries at the church. Is it possible to get his contact info so we can determine when would be the best time to join for the meeting and get involved? Thanks.'),
('13884', 'Hello my name Leon Thompson My wife and I have been a members of the river since late February early March of this yr. In the new members class I took the spiritual gift test/survey and it said that my spiritual gift was evangelism. I\'m looking to get some advice on what that means and walking in the propose in which he may have placed that gift in me for! The best way to reach me is thru email. So if I could possibly get to sit down one on one with the Pastor so maybe he can help lead me in the path that my life is headed it would be appreciated. \r\n                                                 '),
('13908', 'I am in need or prayer for my relationship. Myself and my girlfriend Vida Milligan of 3 1/2 years have been having a rough time since last year and have recently separated due to not having faith that we can make it through this storm. Before the recent separation we were talking marriage, baby and a house together now its all falling apart. I would request a prayer over our hearts and relationship to be healed.'),
('13914', 'Pastors Marvin and Deborah,\r\n\r\nI wanted to let you know that I\'ll be moving out of state on the 12th of this month.  I\'ll be moving to Nashville, TN.  Not only has God released me to go, but he\'s made the necessary provisions.\r\n\r\nI\'m excited, but leaving my church family is not easy for me.  You all are truly irreplaceable.  I was so broken when God sent me to The River, and now I feel whole again, like I finally know God for who he really is.  And although no one can replace Jesus, you two are my hero and shero...for real.\r\n\r\nIf I don\'t talk to you before then, I love you both, as well as the ROLCC family, more than words can express.  \r\n\r\nLove,\r\nMelodie'),
('13937', 'Greetings Pastor & Dr. Debra Jackson:\r\nJust wanted to give you a quick update. Our bankruptcy has been finalized and our medical debts and collections have been discharged! We still have the student loans to deal with but all of the other medical debts and collections has been cancelled. Thank you both for the encouragement along the way. It has not been easy, but God has really helped us get through. Thank you Pastor for your transparency about your own personal financial process today during service. Your openness has been a help throughout this process. God bless and have a great week!'),
('13945', 'Firstly, I want to thank you for practicing what you preach.  You see, I attended a local church for years and never saw my pastor praising God.  He would come out (from the back) only when time to preach, then escape to the back afterwards, never congregating with his congregation.  I saw both, you Pastor and First Lady, praising God.  \r\n\r\nI attended ROLCC twice.  On today, 6/14 Pastor Marvin J gave a word that someone had received bad news within the past week or so....well, you were speaking to me.  Last Sunday, my mom was sitting on the side of the bed and fell over after a bad asthma attack.  She stopped breathing until paramedics arrived and performed CPR.  Due to the lack of oxygen, she has substantial brain damage and is in a vegetative state.  However, I walk by faith, not by sight!  I am believing God for a full recovery for my mom.  My mom is a Christian.  She was not feeling well on the day of her asthma attack, but wanted to go to Sunday School and church, so went there instead of the hospital.  I\'m not sure who Gabby is, but the First Lady\'s update on her condition was confirmation that prayer works and that it\'s time to start praising Jesus for what He\'s getting ready to do.  Thank you for the uplifting word on today.  I will soon share my praise report with you.');
